INSERT INTO `comics` VALUES ('1', '死神', '久保帶人', 'http://www.mangabz.com/search?title=%e4%b9%85%e4%bf%9d%e5%b8%a6%e4%ba%ba&f=2', '1', '31,2', '2.1', '除了能夠看到靈魂，別無是處的普通高中生——黑崎一護有一天邂逅了一名少女，接著人生就發生了很大的轉變。自稱為死神的少女——朽木路奇亞，追著被稱做虛的惡靈突然出現到了一護面前。由于一護的靈力很高，他就成為了虛下手的對像。身受重傷的路基亞無法解決惡靈，不得已只有把死神的能力分給一護，成為死神的一護與失去死[+展開]死神力量的路奇亞就一起開始了新的戰斗…[-折疊]', 'http://cover.mangabz.com/1/1/20200101121446_360x480_68.jpg', '設定集10', '618', '6180', 'https://i0.hdslb.com/bfs/manga-static/4055193fafedbd6d7fb542f01fa7699678d1a529.png@568w_319h.png', '2020-03-23', '37', null);
INSERT INTO `comics` VALUES ('2', 'JoJo奇妙冒險', '荒木飛呂彥', 'http://www.mangabz.com/search?title=%e8%8d%92%e6%9c%a8%e9%a3%9e%e5%90%95%e5%bd%a6&f=2', '1', '31,2,15', '3.1', 'JoJo奇妙冒險漫畫 ，JOJO奇妙冒險漫畫又稱作JOJO奇妙歷險記漫畫，一曲歌頌人類的贊歌 19世紀末的一個雨夜，英國貴族祖斯達從昏迷中醒來，誤將正在偷竊其財物的達利歐·布朗度當成了救命恩人。12年后，為了報恩祖斯達收養了布朗度的兒子迪奧，并且將其和自己的兒子祖納桑一起撫養長大。但迪奧野心勃勃，成[+展開]成年后他不思報恩反而處心積慮的密謀奪取喬斯達家族的所有財富。不想東窗事發，窮兇極惡的迪奧逐喪心病狂殺害恩人祖斯達，并使用邪惡的石鬼面具里的魔力變成了一… 每一個人物，都被賦予了真正的靈魂……他們是獨立的，擁有真正的人格，同時也就有了各種缺點，也許正因為這樣，他們才一次次的，成功的占有了我的心……為他們感動，為他們擔憂，為他們流淚……荒木先生為我們創造了一個怎樣的世界啊！無論是善人還是惡人，還是平凡的人，他們的生命都在這里閃爍著光輝…[-折疊]', 'http://cover.mangabz.com/1/2/20191202111321_360x480_100.jpg', '第121卷', '224', '2241', 'https://i0.hdslb.com/bfs/manga-static/3d3ceeb1ad793f9963c070645755cba6fa9d114e.jpg@568w_319h.jpg', '2020-03-23', '15', null);
INSERT INTO `comics` VALUES ('3', '銃夢LO', '木城幸人', 'http://www.mangabz.com/search?title=%e6%9c%a8%e5%9f%8e%e5%b9%b8%e4%ba%ba&f=2', '0', '31,25', '4.1', '和在惡魔般鐵士代諾的決戰之后，凱莉掉下了一個可怕的陷阱，她的頭腦被帶入了空中都市－沙雷姆，和最強的機體整合在一起！在沙雷姆人的秘密曝光后，本是樂園的空中都市興起暴動，四處都在發生著血腥的生死決斗。', 'http://cover.mangabz.com/1/3/20191202120044_360x480_53.jpg', '第129話 探尋加里ⅩⅧ', '150', '1502', 'https://i0.hdslb.com/bfs/manga-static/d1491f878068d7865171abab0b979eebe68c1dc0.png@568w_319h.png', '2020-03-23', '25', '36');
INSERT INTO `comics` VALUES ('4', '魔偶馬戲團', '藤田和日郎', 'http://www.mangabz.com/search?title=%e8%97%a4%e7%94%b0%e5%92%8c%e6%97%a5%e9%83%8e&f=2', '1', '25', '5.1', '「才賀」 是日本大財團，以高科技產品聞名。才賀集團的各式各樣機械技術之所以處于領導地位， 是因為才賀家的男性由他們的祖先到現在都很喜歡機動木偶， 所以對于機械設計頗有心得。 才賀集團主席才賀貞義和情婦生下一個小孩子，名叫 \"勝\" ，他自少被人欺負，性格內向怕事。不過他的命運很快有了改變， 才賀貞義在[+展開]在一次交通意外中身亡， 最估不到的是他竟然將所有遺產交托給勝，一個小學五年級的學生。 這樣的安排當然使貞義的兒子和女兒不滿，他們一定會加害于勝的， 希望拿回那筆遺產。于是勝就不斷被人追殺， 但是他記得爺爺從前說過，如果有這一天的話，便到馬戲團找一個叫\"白銀\"的人，他自然會保護勝的了。在前往馬戲團途中，遇上了 \"加藤鳴海\" ，他在途中還不斷保護勝，而且更成為了好朋友。到了馬戲團， 鳴海已無法再和木偶追殺組抗行，在千鈞一發之際，白銀出現了， 并且控制一個木偶 「丑角」將所有敵人擊退。當然，一次失敗，他們還會繼續派人加害于勝， 而且還有其它勝的親屬加入這遺產爭奪戰中，他們不斷派木偶追殺勝， 一幕幕轟烈非常的戰斗將不斷出現，究竟這次事件是否另有目的， 背后又會隱藏著什么秘密呢....[-折疊]', 'http://cover.mangabz.com/1/4/20191202110243_360x480_64.jpg', '第44卷', '44', '443', 'https://i0.hdslb.com/bfs/manga-static/1c8787155d8d1d99838c0021af00f4aeca01afcd.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('5', '犬夜叉', '高橋留美子', 'http://www.mangabz.com/search?title=%e9%ab%98%e6%a1%a5%e7%95%99%e7%be%8e%e5%ad%90&f=2', '1', '31,2', '6.1', '來自一個神社的少女日暮戈薇，是最普通的初三學生。由家中的井到了500年前的戰國時代，在那里解開了被封印的半妖——犬夜叉的封印。犬夜叉為了成為完全的妖怪而想要得到四魂之玉。四魂之玉變成碎片飛散四處。他們為了尋找四魂之玉的碎片和妖怪們戰斗的旅程開始了……', 'http://cover.mangabz.com/1/5/20191202113852_360x480_57.jpg', '特別篇：在那之后', '129', '1294', 'https://i0.hdslb.com/bfs/manga-static/9601e31ee3fafd03a2528f62cb7cbf0e617b8196.jpg@568w_319h.jpg', '2020-03-23', '37', null);
INSERT INTO `comics` VALUES ('6', '翼Tsubasa', 'CLAMP', 'http://www.mangabz.com/search?title=CLAMP&f=2', '1', '31,2,15', '7.1', '住在玖樓國的小狼和小櫻，兩人克服立場的不同，心意相通，小櫻卻因突然現身的刺客而出現異狀，失去了所有的記憶。拯救小櫻的方法只有一個——找出小櫻飛散到異世界的羽毛。', 'http://cover.mangabz.com/1/6/20191202115008_360x480_78.jpg', '第233話', '144', '1445', 'https://i0.hdslb.com/bfs/manga-static/c5376f739559c6693d78d1537fad7b367155167d.jpg@568w_319h.jpg', '2020-03-23', '15', null);
INSERT INTO `comics` VALUES ('7', '旋風管家', '煙健二郎', 'http://www.mangabz.com/search?title=%e7%83%9f%e5%81%a5%e4%ba%8c%e9%83%8e&f=2', '0', '31', '8.1', '話說有一個天真、可愛、可悲、懂事的小男孩，在幼時被夢中的圣誕老公公欺騙（？）下，在九歲起就虛報年齡地邊打工、邊上學，并十分努力地賺錢去養活自己那對廢柴父母。\n    但好景不常，他在16歲的那年，因為父母輸了大錢，而把兒子（即主角）的身體器官賣給黑道。在逃亡中，奇怪地和一名千金小姐產生下不解之緣，[+展開]，之后就被委任為其管家。\n[-折疊]', 'http://cover.mangabz.com/1/7/20191202151735_360x480_63.jpg', '最終話全彩', '517', '5176', 'https://i0.hdslb.com/bfs/manga-static/58b5add2ce1cb57025c5b621915fb1c376f95108.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('8', '欺詐游戲', '甲斐谷忍', 'http://www.mangabz.com/search?title=%e7%94%b2%e6%96%90%e8%b0%b7%e5%bf%8d&f=2', '1', '31,2', '2.2', '女主角，神崎直，如同名字一樣正直的人，撿到一百圓也會去交給警察局的，正直的，笨蛋。貌似是無緣無故其實卻像是上天安排般的被卷入了30天內要守住一億圓的巨額謊言游戲——Liar Game 而她的對手，則是那個中學時對她關懷備至的“好”老師，正直的笨蛋，被信任的老師騙走了她的那一億圓…… 經過律師的提醒，[+展開]，她找到了天才詐騙師秋山深一，三年前，這人僅用騙術就把一個大企業騙跨了…… 又是命運般的相遇…… 十分有意思的一部作品，講述與謊言有關的人類心理~~ 自DEATH NOTE之后，看來心理戰的漫畫風已經刮起來了～～[-折疊]', 'http://cover.mangabz.com/1/8/20191202115545_360x480_56.jpg', '第126話 冷酷', '218', '2187', 'https://i0.hdslb.com/bfs/manga-static/21501c18841b84d3ad2c179438f84a9a486bf03e.png@568w_319h.png', '2020-03-23', '17', null);
INSERT INTO `comics` VALUES ('9', '家庭教師', '天野明', 'http://www.mangabz.com/search?title=%e5%a4%a9%e9%87%8e%e6%98%8e&f=2', '1', '31', '3.2', '人生無望的國中生－阿綱家里，來了一位家庭教師！外表看起來象是個嬰兒，其實職業是殺手的里包恩，他來的目的是要讓阿綱成為黑手黨的第10代首領！只要發揮死氣什么的都辦得到！？于是阿綱的搏命特訓開始了！', 'http://cover.mangabz.com/1/9/20191202152218_360x480_55.jpg', '第409話 再見', '328', '3288', 'http://i0.hdslb.com/bfs/manga-static/af9951e3d200cebd4b7a6215a385025f30020d49.png@568w_319h.png', '2020-03-29', '31', '37');
INSERT INTO `comics` VALUES ('10', '圣斗士星矢冥王神話', '手代木史織', 'http://www.mangabz.com/search?title=%e6%89%8b%e4%bb%a3%e6%9c%a8%e5%8f%b2%e7%bb%87&f=2', '0', '31,25', '4.2', '在焦急的等待之中，4月27日號的《周刊少年Champion》終于如期發售，傳的沸沸揚揚的車田正美老師的《圣斗士星矢》系列最新作閃亮登場！不出所料，果然全部彩頁，但圖片數量不多，因為連載并未正式開始，本期刊登的《圣斗士星矢THE LOST CANVAS冥王神話》為Prologue 1，也就是序章中的序[+展開]序章，故事只是稍稍開了個頭，精彩的內容還要等夏天正式開始的連載中揭曉。 \n\n    實際上故事還要從《冥王篇》接續，Prologue 1的前半部分回顧了身著神圣衣的星矢擊中冥王哈迪斯的一幕。不過考究原著之后會發現其實這次使用的對白與《冥王篇》有明顯的差別。在表述冥王被天馬座傷害到肉體一事時，冥王說道“那個人是在神話時代……不，在前世遇見過一次。兩百四十多年前……”，看來“神話時代”以及“243年前圣戰”這兩個概念被當作原來的一個BUG被修正，從而徹底區別開來[-折疊]', 'http://cover.mangabz.com/1/10/20191202144526_360x480_92.jpg', '番外篇', '294', '2949', 'https://i0.hdslb.com/bfs/manga-static/444216d0da320ea436628f0ee7d195f9546fa81f.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('11', '圣斗士星矢冥王神話NEXT DIMENSION', '車田正美', 'http://www.mangabz.com/search?title=%e8%bd%a6%e7%94%b0%e6%ad%a3%e7%be%8e&f=2', '0', '25', '5.2', '故事講述243年前，剛從青銅圣斗士上升為黃金圣斗士的年輕的童虎和史昂二人，得知冥王今世選中的肉體所在的地方，于是決定私自行動。到達目的地時他們發現冥王選中的少年是一個喜愛繪畫的溫柔少年·亞倫。正當童虎和史昂要襲擊亞倫的時候，亞倫的摯友天馬出現，不知圣斗士為何物的天馬卻穿上了天馬星座的青銅圣衣，并向童[+展開]童虎和亞倫揮拳相向。但因為實力懸殊，天馬被打倒在地。天馬趁亂帶亞倫逃走。這時，亞倫體內似乎有某種異樣的東西在蠢蠢欲動…[-折疊]', 'http://cover.mangabz.com/1/11/20191202131310_360x480_85.jpg', '第95話 夢醒之后', '102', '10210', 'https://i0.hdslb.com/bfs/manga-static/e6a9698dd0bb63972bb82aac3f3e3b5268387fc1.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('12', '夏目友人帳', '綠川幸', 'http://www.mangabz.com/search?title=%e7%bb%bf%e5%b7%9d%e5%b9%b8&f=2', '0', '35', '6.2', '少年-夏目擁有看的見妖怪的這項秘密。他得到了外婆-鈴子留下和妖怪們之間的契約書。從此以后,就陷入被妖怪們追趕的窘境。開始和保鏢-貓咪老師一同將名字還給妖怪們的夏目會——？', 'http://cover.mangabz.com/1/12/20191202134631_360x480_72.jpg', '外傳：116', '240', '24011', 'https://i0.hdslb.com/bfs/manga-static/49d1b0877379b62f16aaa18f2c78450b41bf3077.png@568w_319h.png', '2020-03-29', '35', null);
INSERT INTO `comics` VALUES ('13', '會長是女仆大人', '藤原飛呂', 'http://www.mangabz.com/search?title=%e8%97%a4%e5%8e%9f%e9%a3%9e%e5%90%95&f=2', '1', '26', '7.2', '作為原本是男校的星華高中的學生會長美咲，為了保護女孩子，過著每天和男生作對的日子 這樣的她竟秘密在＂女仆咖啡室＂做兼職．而這個秘密卻被模范男生椎冰知道了會長與女仆的雙重生分．', 'http://cover.mangabz.com/1/13/20191202131507_360x480_84.jpg', '婚后特別篇', '100', '10012', 'https://i0.hdslb.com/bfs/manga-static/7667bfb96827d4f0d8fe2592f406d564e88f2d9d.jpg@568w_319h.jpg', '2020-03-29', '26', null);
INSERT INTO `comics` VALUES ('14', '中華小當家', '小川悅司', 'http://www.mangabz.com/search?title=%e5%b0%8f%e5%b7%9d%e6%82%a6%e5%8f%b8&f=2', '0', '35', '8.2', '清朝末期四川省首屈一指的菜館“菊下樓”，即將舉行一場新主廚的決賽。前任主廚之子亞昂面對曾是母親的弟子紹安，兩人將展開一場“魔幻麻婆豆腐”之爭，究竟鹿死誰手？亞昂又如何成為真正的大廚師？本書在斗志中間，散出中菜的香氣。 \n阿昂在就任菊下樓的主廚之前，決定前往廣州的“陽泉酒家”修業。一到廣州，阿昂就在[+展開]在市場遇到了一位瞧不起中國菜的法國廚師約翰。巴杰魯。阿昂一氣之下，竟然向他下了戰書！一場畢拉夫對抗炒飯的米食料理大對決即將展開阿昂為了要復興陽泉酒家而參加廣州最大的盛會“餃子大會”，可是會場卻出現了一對餃子兄弟妨礙競爭對手參加比賽，而使得會場陷入了一片混亂之中！阿昂能夠克服這個不利的情勢勇奪冠軍嗎[-折疊]', 'http://cover.mangabz.com/1/14/20191202113039_360x480_103.jpg', '極57', '76', '7613', 'https://i0.hdslb.com/bfs/manga-static/d342cd7ebddd8dbc79b4385f3955968538723b0e.jpg@568w_319h.jpg', '2020-03-29', '37', null);
INSERT INTO `comics` VALUES ('15', '黑鳥戀人(BLACK BIRD)', '櫻小路鹿乃子', 'http://www.mangabz.com/search?title=%e6%a8%b1%e5%b0%8f%e8%b7%af%e9%b9%bf%e4%b9%83%e5%ad%90&f=2', '1', '26', '9.2', '　實沙緒從小就看得見妖怪。一直保護著這樣的她的是初戀情人——匡。「有一天我一定會去接你。」\n　　小時候許下的約定成真，實沙緒在16歲生日前一天與匡重逢。可是也同時得知「在過了16歲之后，實沙緒的血肉能令妖怪長生不老，若迎娶為妻就會替那一族帶來繁榮。」的這個事實。而且匡也是想得到實沙緒的妖怪「天狗」[+展開]」一族的當家。\n　　但是，身為人類的實沙緒在和妖怪匡結合后，不知道會變成怎樣…這個答案就只記錄在妖狐一族擁有的「仙果錄」當中。不過它卻在妖狐的當家「忠信」與匡戰斗的途中，被某人奪走了。\n　　身為當家，周圍的人逼著匡盡早與實沙緒結合。為了在不抱實沙緒的狀況下也能繼續擔仍當家，匡決心抹煞會威脅自己地位的祥。\n　　匡帶著實沙緒，回到天狗的故鄉。在哪里，遭到幽禁的祥早已為了要從匡手中奪取當家寶座而展開行動。得知此事的實沙緒自愿但任誘餌，主動接近祥……[-折疊]', 'http://cover.mangabz.com/1/15/20191202114425_360x480_79.jpg', '外傳：2 番外篇2', '42', '4214', 'https://i0.hdslb.com/bfs/manga-static/1a5886e754c71bfffad209a0d9c30217e477fba0.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('16', '滑頭鬼之孫', '椎橋寬', 'http://www.mangabz.com/search?title=%e6%a4%8e%e6%a1%a5%e5%ae%bd&f=2', '1', '31', '2.6', '當太陽西下便是逢魔之時。 繼承了妖怪總帥·滑頭鬼之血的奴良陸生, 乍一看是個普通男孩。 其實憧憬著想當上爺爺那樣了不起的首領… 率領妖怪本宗·奴良組的手下。 但是…！ ？ 痛快妖怪正義武俠戲,在此開演——！ ！…', 'http://cover.mangabz.com/1/16/20191202142753_360x480_77.jpg', '滑頭鬼x派出所短篇', '246', '24615', 'https://i0.hdslb.com/bfs/manga-static/4d93accde43fe3d7cf45ace04b60389396c6835a.png@568w_319h.png', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('17', '神奇寶貝特別篇', '日下秀憲山本智', 'http://www.mangabz.com/search?title=%e6%97%a5%e4%b8%8b%e7%a7%80%e5%ae%aa&f=2', '0', '2', '3.6', '這個世界充滿各種未知的動物，以寶貝球捕捉后可以縮小為手掌可握的大小，並為人類所驅使', 'http://cover.mangabz.com/1/17/20191202151952_360x480_74.jpg', 'sun＆moon篇20', '349', '34916', 'https://i0.hdslb.com/bfs/manga-static/c5ff1257cb92a6d923350689dd012b17e4716fea.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('18', '美食的俘虜', '島袋光年', 'http://www.mangabz.com/search?title=%e5%b2%9b%e8%a2%8b%e5%85%89%e5%b9%b4&f=2', '1', '31', '4.6', '是一部很不錯的作品,世界觀很像獵人早期的時候,很龐大的劇情結構...完全不像其名字一樣...不會讓人認為這是一部美食漫畫...超越了\"美食漫畫\"那渺小的格局...讓我發現...哇!...原來美食漫畫也可以這樣畫!...很JUMP的風格!...很有前景的美食漫畫!...\n本作是一部以“美食”為主的漫[+展開]漫畫作品，全身的肉在舌間融化并且浮出一層油的的野獸，一整年都結有美味蝦蟹肉的樹、流出源源不絕的香醇白蘭地涌泉的泉水，這是一個探求未知的美味時代，每個美食家的人生菜單分為前菜、湯、魚、肉、主菜、沙拉、甜點、飲料全8 種，美食四天王之一的特瑞科為了完成自己的全餐菜單，踏上了尋找珍奇美食的旅程[-折疊]', 'http://cover.mangabz.com/1/18/20191202144847_360x480_38.jpg', '第396話 前所未見的食材', '425', '42517', 'https://i0.hdslb.com/bfs/manga-static/bc5b582edb1cb5a097c37e17ad9c5ecceca0b2c8.jpg@568w_319h.jpg', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('19', '只有神知道的世界', '若木民喜', 'http://www.mangabz.com/search?title=%e8%8b%a5%e6%9c%a8%e6%b0%91%e5%96%9c&f=2', '0', '1', '5.6', '　 就讀于舞島學園高中部的桂木桂馬是個喜歡戀愛養成游戲（Galgame）的高中生。曾經成功攻略過10000名女生（游戲中），有著能夠攻略任何類型女性的能力，是擁有一切galgame攻略的網站“落とし神”的管理者，以高超的技術被廣大機友尊稱為“落とし神”（攻略之神、攻陷之神）。\n　　某日，一名少女從[+展開]從天而降來到他的面前。這名少女名叫艾露西，從地獄遠道而來的她委托桂馬為她捕獲“驅魂”(驅け魂)的協力者。方法是使被附身的人類戀愛，填補她的心靈縫隙，從而把因在心里無處容身而逃出來的驅魂捕獲。對現實生活中的女孩退避三舍的桂馬自然毫不猶豫的拒絕了艾露西的要求，但是由于和艾露西結成的契約危及生命，所以他不得不心不甘情不愿的承諾幫忙。于是，GAL界的“攻略之神”桂木桂馬終于以三次元世界的女生發動了攻略[-折疊]', 'http://cover.mangabz.com/1/19/20191202151440_360x480_56.jpg', '同人：EXTRA - 3', '313', '31318', 'https://i0.hdslb.com/bfs/manga-static/0f8a3eb3c07b79eefca1c1548f50d5eaf6474514.jpg@568w_319h.jpg', '2020-03-30', null, null);
INSERT INTO `comics` VALUES ('20', '白兔糖', '宇仁田ゆみ', 'http://www.mangabz.com/search?title=%e5%ae%87%e4%bb%81%e7%94%b0%e3%82%86%e3%81%bf&f=2', '1', '31', '6.6', '白兔糖漫畫英文原名：usagi-drop漫畫。有點痞痞的老爸與小女兒的小旅行！？等待著凜和大吉的是—！？收養了外公的私生子-凜，并養育著她的大吉，成功的找到了凜的親生母親-正子。談話的結果是，大吉重新確定了將凜撫養長大的決意。講述6歲小女孩與未曾見面的30歲父親的溫馨親情生活！', 'http://cover.mangabz.com/1/20/20191202131715_360x480_32.jpg', '第10卷', '62', '6219', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('21', '藍色的除魔師', '加藤和惠', 'http://www.mangabz.com/search?title=%e5%8a%a0%e8%97%a4%e5%92%8c%e6%83%a0&f=2', '0', '31,2,15', '7.6', '主人公奧村燐，是在正十字學園上學的學生，雖說表面上是炎的后代但是實際上是魔神撒旦的兒子，只能用降魔剣抑制這力量，藤本被撒旦殺死后，就敲開正十字騎士団的大門，立志成為除魔師,他的目標是—揍撒旦一頓……于2009年5月號始連載于《Jump Square》（簡稱Jump SQ、日語：ジャンプスクエア）', 'http://cover.mangabz.com/1/21/20191202141739_360x480_55.jpg', '第112話 SsC40:00c', '146', '14620', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-29', null, '');
INSERT INTO `comics` VALUES ('22', '妄想學生會', '氏家卜全', 'http://www.mangabz.com/search?title=%e6%b0%8f%e5%ae%b6%e5%8d%9c%e5%85%a8&f=2', '0', '31,1', '8.6', '創校已有50年，原本是女校的私立櫻才學園，因受到少子化的影響，于今年起變更為男女合校。因為是第一年，男生人數還相當稀少，全校男女生的比率為女生524人，男生28人。對男生來說，正常應該像是后宮一般(？)………但是！以主角津田隆利的立場來看，恐怕完全沒這...', 'http://cover.mangabz.com/1/22/20191202141356_360x480_60.jpg', '第553話', '531', '53121', 'https://i0.hdslb.com/bfs/manga-static/de6879a69aa40a85e087f2b80c06b12ff34de8cf.png@568w_319h.png', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('23', 'inferno_地獄', '厘のミキ', 'http://www.mangabz.com/search?title=%e5%8e%98%e3%81%ae%e3%83%9f%e3%82%ad&f=2', '0', '', '2.2', '學生高澤的父母被殺，妹妹奈奈腳部殘疾，這一切都是因為高澤是被地獄所纏之人，他懼怕與別人交談，因為確信一旦交談了，別人也會受到牽連斷手斷腳，孤獨的少年和自稱為小野篁的霸道男子相遇了……“從今天起，我要全權管理你的人生。”', 'http://cover7.mangabz.com/7/6968/6968.jpg', '第4話', '4', '422', 'https://i0.hdslb.com/bfs/manga-static/779459cf39db6f0a7c16644a7054fbe7af05a018.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('24', '秒速5厘米', '新海誠清家雪子', 'http://www.mangabz.com/search?title=%e6%96%b0%e6%b5%b7%e8%af%9a&f=2', '1', '26', '3.2', '秒速5厘米漫畫改編自日本導演新海誠于2007年發布的動畫電影《秒速5厘米》，該電影在2007年亞洲太平洋電影獎中獲得最佳長篇動畫電影獎。時間是1990年代的日本，遠野貴樹與篠原明里原本是同班同學的好朋友，自從小學畢業之后，兩人都沒有再見一次面。分隔兩地的兩個人，靠著書信往來保持聯絡，直到貴樹知道即將[+展開]將跟隨家人搬到鹿兒島，距離明里更遠的地方，于是兩人約定了再見面的時間。計劃好的行程，卻遇上了暴風雪，電車在潔白的雪中，停停開開，貴樹的心，也在細微的變化…[-折疊]', 'http://cover.mangabz.com/1/24/20191202134332_360x480_40.jpg', '第2卷', '11', '1123', 'https://i0.hdslb.com/bfs/manga-static/0230d1f29311a48dbec77694246664bb93b3061a.png@568w_319h.png', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('25', '異域之鬼', '由貴香織里', 'http://www.mangabz.com/search?title=%e7%94%b1%e8%b4%b5%e9%a6%99%e7%bb%87%e9%87%8c&f=2', '1', '', '4.2', '令人戰栗的新連載開幕!!由的作者由貴香織里的最新連載.是上天的使者還是黑暗的私生子!?三個孩子在約定什么?騙人就要飲針千根......?被深紅色的鮮花染上色彩的,記憶的螺旋......', 'http://cover.mangabz.com/1/25/20191202135509_360x480_96.jpg', '第24話 最終話', '25', '2524', 'https://i0.hdslb.com/bfs/manga-static/32782ad4542dd69f3a5800d743848be75c7f0f26.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('26', '元氣少女緣結神', '鈴木JULIETTA', 'http://www.mangabz.com/search?title=%e9%93%83%e6%9c%a8JULIETTA&f=2', '1', '26', '5.2', '女主角奈奈生因好賭的父親在欠下一屁股債后離家出走，流落街頭的時候幫助了一位被狗追到樹下的神秘男人，神秘男人知道她的遭遇后說：“那我把我的家給你吧！”于是無家可歸的奈奈生在半信半疑之下前往那個\"家\"，發現那竟是一間荒廢許久的神社，還出現一個狐貍妖怪，自稱是侍奉土地神的狐妖巴衛，而神秘男人竟然是土地神，[+展開]，神秘男人把家讓給她，也就是連土地神的職位也一并交給她，所以女主角開始了當土地神之路··[-折疊]', 'http://cover.mangabz.com/1/26/20191202153544_360x480_75.jpg', '惡蘿王番外', '148', '14825', 'https://i0.hdslb.com/bfs/manga-static/ca7601ffa74f12d9407c602aa3ffdcc3ff82a60b.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('27', '蟲奉行', '福田宏', 'http://www.mangabz.com/search?title=%e7%a6%8f%e7%94%b0%e5%ae%8f&f=2', '0', '31', '6.2', '蟲奉行漫畫 ，簡介高人氣月刊漫畫蟲奉行正式以周刊形式降臨少年sunday！該作品以前作「蟲奉行」為基礎打造的新的故事，為了消滅盤踞江戶的巨大蟲，國家設立「蟲奉行」機構，而少年月島仁兵衛也將以蟲奉行的身份大顯身手~sunday久違的純少年熱血漫畫，請大家拭目以待吧', 'http://cover.mangabz.com/1/27/20191202154107_360x480_80.jpg', '第316話', '317', '31726', 'https://i0.hdslb.com/bfs/manga-static/d6bb444ae45cbad357da73df4b4c1f0d62a31856.png@568w_319h.png', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('28', '白銀之匙', '荒川弘', 'http://www.mangabz.com/search?title=%e8%8d%92%e5%b7%9d%e5%bc%98&f=2', '0', '11', '7.2', '因為某些理由不愿歸家的少年特意從札幌的重點初中升入北部的農業高中。在那兒,他身邊盡是一群懷抱夢想的農家孩子,只有自己找不到未來的目標,繼續迷茫下去。究竟少年的青春故事會如何發展呢？', 'http://cover.mangabz.com/1/28/20191202154519_360x480_49.jpg', '第127話 四季之卷30', '143', '14327', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-29', '11', null);
INSERT INTO `comics` VALUES ('29', '偽戀', '古味直志', 'http://www.mangabz.com/search?title=%e5%8f%a4%e5%91%b3%e7%9b%b4%e5%bf%97&f=2', '1', '1', '2.9', '那是很久以前極為珍貴的約定：你拿著鎖，我拿著鑰匙，將其珍視之物，時刻不離帶在身邊。等到有一天我們長大再會的時候，用這把鑰匙將其中的東西取出來，那時候……我們就結婚吧。十年后，這把鎖依舊尚未開啟。自稱有著大眾臉的高中生一條樂，其實是這一代有名的混混組首領的獨子。想過平凡人生的他，在升入高中以后與曾經有[+展開]有過約定的女孩再度相遇，不得不展開了不平凡的高中生活…[-折疊]', 'http://cover.mangabz.com/1/29/20191202160724_360x480_57.jpg', '4seasons04', '277', '27728', 'https://i0.hdslb.com/bfs/manga-static/1b09fe4f2c0f790fdbc02630b297997108641ef0.png@568w_319h.png', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('30', '極黑的布倫希爾特', '岡本倫', 'http://www.mangabz.com/search?title=%e5%86%88%e6%9c%ac%e4%bc%a6&f=2', '1', '2,25', '3.9', '高中生－－村上良太始終忘不了自己兒時意外害死的青梅竹馬。\n為了完成兩人的約定，良太加入天文社不斷尋找外星人。\n某一天，長相與黑貓非常相似的轉學生黒羽寧子轉入良太的班級，并且救了他一命。良太因此發現她擁有超越一般人的能力，是從研究所中脫逃出來的魔法師。魔法師每天必須服用一粒鎮死劑以維持生命，否則身[+展開]身體會逐漸融化而死。良太為了不讓眼前的魔法師們死去，而不斷想辦法尋找鎮死劑以延長大家的性命，故事由此展開[-折疊]', 'http://cover.mangabz.com/1/30/20191202160908_360x480_56.jpg', '第181話 與子偕老', '199', '19929', 'https://i0.hdslb.com/bfs/manga-static/97bb820f87cc5ca639c84432ea72cb0e8d288159.jpg@568w_319h.jpg', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('31', '電波教師', '東毅', 'http://www.mangabz.com/search?title=%e4%b8%9c%e6%af%85&f=2', '1', '31', '4.9', '講述的是宅人教師的教育故事。主人公青年時沉迷于漫畫、動畫片、游戲，把更新動畫微博作為每天的課題。但是這樣的啃老族，竟然成為某高校的按時出勤講師，更令人驚訝的是，主人公勇于通過打破常規的教育方針來教導學生。', 'http://cover.mangabz.com/1/31/20191202161052_360x480_68.jpg', '第247話 被繼承的YD', '247', '24730', 'https://i0.hdslb.com/bfs/manga-static/97bb820f87cc5ca639c84432ea72cb0e8d288159.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('32', 'MIX', '安達充', 'http://www.mangabz.com/search?title=%e5%ae%89%e8%be%be%e5%85%85&f=2', '0', '34,35', '5.9', 'mix漫畫 ，棒球英豪，不用解釋了吧。安達充老師最新作品。', 'http://cover.mangabz.com/1/32/20191202161756_360x480_78.jpg', '第80話 決勝負！', '80', '8031', 'https://i0.hdslb.com/bfs/manga-static/ee57ab535919985ef081fb018a8c6993c4c7a347.jpg@568w_319h.jpg', '2020-03-29', null, null);
