INSERT INTO `comics` VALUES ('35', '青年黑杰克', '手冢治蟲大熊 ゆうご', 'http://www.mangabz.com/search?title=%e6%89%8b%e5%86%a2%e6%b2%bb%e8%99%ab&f=2', '0', '2', '8.9', '青年黑杰克漫畫 ，以BLACK JACK的醫學生時代為焦點、以原創故事的形式對“他為什么會成為無證醫生”進行深入描寫。為什么BLACK JACK會成為無證醫生?為什么BLACK JACK過度索取手術費?還有他與宿敵DOCTOR KIRIKO的因緣！', 'http://cover.mangabz.com/1/35/20191202163004_360x480_58.jpg', '第89話 24年后的歸來⑤', '100', '10034', 'https://i0.hdslb.com/bfs/manga-static/96d508f458cf8685178d0bcec2ce17dd1bc16667.png@568w_319h.png', '2020-03-29', '2', null);
INSERT INTO `comics` VALUES ('36', '我的青春戀愛物語果然有問題', '佳月鈴茅渡航', 'http://www.mangabz.com/search?title=%e4%bd%b3%e6%9c%88%e9%93%83%e8%8c%85&f=2', '0', '31,1', '2.6', '如果失敗真能成為是青春的象征的話,可謂是充滿青春也不足為奇吧........TV動畫化決定!!備受矚目的作品新連載開始!!!!我的青春戀愛喜劇果然有問題~', 'http://cover.mangabz.com/1/36/20191202163300_360x480_60.jpg', '第76話', '80', '8035', 'https://i0.hdslb.com/bfs/manga-static/69568253704c16ff2e1667643dc70883aafd83e7.jpg@568w_319h.jpg', '2020-03-27', null, null);
INSERT INTO `comics` VALUES ('37', '笨女孩', 'ヒロユキ', 'http://www.mangabz.com/search?title=%e3%83%92%e3%83%ad%e3%83%a6%e3%82%ad&f=2', '0', '31', '3.6', '笨女孩漫畫 ，大家喜聞樂見的無節操漫畫《漫畫家與助手們》的作者ヒロユキ新作！笨蛋女孩和不得不照顧她的男豬的歡樂日常，無節操老師的作品必有胖次殺必死你懂的！', 'http://cover.mangabz.com/1/37/20191220104431_360x480_82.jpg', '第137話', '140', '14036', 'https://i0.hdslb.com/bfs/manga-static/808a2dad5219f3da81a112a0da0ab607ba9f47ad.jpg@568w_319h.jpg', '2020-04-02', null, null);
INSERT INTO `comics` VALUES ('38', '一拳超人', '村田雄介ONE', 'http://www.mangabz.com/search?title=%e6%9d%91%e7%94%b0%e9%9b%84%e4%bb%8b&f=2', '0', '31,2', '4.6', '主人公埼玉原本是一名整日奔波于求職的普通人。3年前的一天偶然遇到了要對淘氣少年下殺手的異變螃蟹人后，回憶起年少年時“想要成為英雄”的夢想，最終拼盡全力救下了淘氣少年。之后通過拼命鍛煉，埼玉終于脫胎換骨獲得了最強的力量，但同時失去了頭發成了光頭。在獨自做了一段時間英雄后，正式加入英雄協會，與眾多英雄一[+展開]一起開始了對抗各種怪人以及惡勢力的生活…[-折疊]', 'http://cover.mangabz.com/1/38/20191206093227_360x480_65.jpg', '第165話', '389', '38937', 'https://i0.hdslb.com/bfs/manga-static/f9378bdb998c01f757e839b9791d09792e406979.jpg@568w_319h.jpg', '2020-03-31', '31', null);
INSERT INTO `comics` VALUES ('39', '靈能百分百', 'ONE ', 'http://www.mangabz.com/search?title=ONE+&f=2', '1', '31,2', '5.6', '塵世中仍有許多科學無法解釋的現象，當這些事發生時，解決這些事件的被稱之為【靈能力者】！', 'http://cover.mangabz.com/1/39/20191202163932_360x480_55.jpg', '靈幻07', '293', '29338', 'https://i0.hdslb.com/bfs/manga-static/2e6147c7ee17d957e898e03652b2d096610b1f5e.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('40', '姐姐的妄想日記', '田口ケンジ', 'http://www.mangabz.com/search?title=%e7%94%b0%e5%8f%a3%e3%82%b1%e3%83%b3%e3%82%b8&f=2', '0', '', '6.6', '女主角近衛靄子是一位“文武雙全”并且人緣很好的女子高生，然而這樣的她同時又是一位抱有“我的弟弟是萌上了姐姐的變態，必須要從弟弟的魔掌中守護身體，同時教他重新做人”這樣妄想的問題姐姐。雖然相比歷年的優勝者來說靄子的知名度尚有限，但這也正好為姐系漫畫的愛好者宣傳了一部新作 ', 'http://cover.mangabz.com/1/40/20191202164239_360x480_62.jpg', '第288話 阿姐心跳心跳', '288', '28839', 'https://i0.hdslb.com/bfs/manga-static/7977f7d84dbdac5fd7198749d9f0a48ec7794e8c.png@568w_319h.png', '2020-04-01', null, null);
