INSERT INTO `comics` VALUES ('45', '架刑的愛麗絲', '由貴香織里', 'http://www.mangabz.com/search?title=%e7%94%b1%e8%b4%b5%e9%a6%99%e7%bb%87%e9%87%8c&f=2', '0', '2,15', '3.4', '由貴香織里筆下華麗新作——大逃殺幻想劇！殘忍血腥、黑暗墮落交織而成的愛恨篇章。暗黑茶話會終于開始了！大哥生日會開啟的新策劃——只有互相殘殺才能獲得繼承權。為了獲得永葆青春的秘水，絕望的殺戮拉開帷幕！', 'http://cover.mangabz.com/1/45/20191202170349_360x480_83.jpg', '第11話', '13', '1344', 'https://i0.hdslb.com/bfs/manga-static/43cb8525dda33dcd5d79783b958826ebb6aef7a4.png@568w_319h.png', '2020-04-01', null, null);
