INSERT INTO `comics` VALUES ('47', 'GrandBlue', '井上堅二吉岡公威 ', 'http://www.mangabz.com/search?title=%e4%ba%95%e4%b8%8a%e5%9d%9a%e4%ba%8c&f=2', '0', '26,1', '5.4', 'GrandBlue漫畫 ，以上大學為契機寄宿在海邊爺爺家的主人公·北原伊織，遇到了絕世美女與散發著青春的學長們。為了尋求無可替代的瞬間，北原伊織揮灑青春。最棒的大學生活，等著你！！', 'http://cover.mangabz.com/1/47/20191202171505_360x480_73.jpg', '炎術士伊織', '53', '5346', 'https://i0.hdslb.com/bfs/manga-static/122053bc8222752d8f05b97d61d6b47ddc9ea9b7.png@568w_319h.png', '2020-04-01', null, null);
INSERT INTO `comics` VALUES ('48', '國王們的海盜', '深見真さだやす ', 'http://www.mangabz.com/search?title=%e6%b7%b1%e8%a7%81%e7%9c%9f&f=2', '0', '2', '6.4', '國王們的海盜漫畫 ，高中退學、打工也很快就被辭退。沒有社交能力且待人十分冷淡。18歲的是枝一希唯一擁有的就是黑客技術。在開始著手網絡攻擊金融機關的時候，他的面前出現了一個放言「用你的技術來征服世界吧」的極其有錢的男人。黑客少年和工作中毒的天使投資家，他們二人將會創造出怎樣的工作…？\n前所未有的新時[+展開]時代標記誕生！！！[-折疊]', 'http://cover.mangabz.com/1/48/20191202171705_360x480_49.jpg', '第109話', '110', '11047', 'https://i0.hdslb.com/bfs/manga-static/3ac007ef16148e8937f3ba5d110e7b34d161a992.jpg@568w_319h.jpg', '2020-04-01', null, null);
