INSERT INTO `comics` VALUES ('50', '勇者赫魯庫', '七尾ナナキ', 'http://www.mangabz.com/search?title=%e4%b8%83%e5%b0%be%e3%83%8a%e3%83%8a%e3%82%ad&f=2', '1', '2,15', '8.4', '勇者赫魯庫漫畫 ，魔界的某個國家。 憑藉勇者的一己之力擊敗了魔王。 「已經不用為魔王的事情而擔心了」在人類們到處洋溢著笑容的同時，在魔界中，爭奪新魔王位置的戰斗正在火熱開展著！！！ 但是沒想到出現在賽場上的是…！？ 迷之勇者·赫魯庫的大冒險劇開幕！！！！ 漫畫原名helck 取中文名加上勇者兩字 點[+展開]點明內容[-折疊]', 'http://cover.mangabz.com/1/50/20191203091855_360x480_74.jpg', '作者動向', '150', '15049', 'https://i0.hdslb.com/bfs/manga-static/40459fd4ba9c6a4d2863957acfbcbd8bd602afa2.png@568w_319h.png', null, null, null);
