INSERT INTO `comics` VALUES ('54', '拳愿阿修羅', '三肉必起  牙霸子  達露沒恩', 'http://www.mangabz.com/search?title=%e4%b8%89%e8%82%89%e5%bf%85%e8%b5%b7++%e7%89%99%e9%9c%b8%e5%ad%90++%e8%be%be%e9%9c%b2%e6%b2%a1%e6%81%a9&f=2', '0', '31,34', '4.0', '拳愿阿修羅漫畫 ，拳愿競技”是企業、商人們賭上巨額利益，雇用斗技者并令其對打之空手格斗競技。原為平息商人斗爭之手段，始于江戶中期，并傳承至現代。 “乃木集團”慶安二年創業。以乃木商事為中心的企業集團。發展運輸業、出版業等業種，拳愿會最古老企業之一。 　　”拳愿絕命淘汰賽“ 　　賭上會長之位所舉辦的格[+展開]格斗淘汰賽。舉辦條件是必須獲得一定數字以上的會員人數贊成。 　　出場的必要條件是： 　　1.是擁有斗技者的拳愿會會員。 　　2.支付規定的參加費[-折疊]', 'http://cover.mangabz.com/1/54/20191203093051_360x480_64.jpg', '第26卷聯動番外', '252', '25253', 'https://i0.hdslb.com/bfs/manga-static/44f955d78755174e7c5fca9a2d4ed72698ebc7dd.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('55', '昭和元祿落語心中', '云田晴子/云田はるこ', 'http://www.mangabz.com/search?title=%e4%ba%91%e7%94%b0%e6%99%b4%e5%ad%90%2f%e4%ba%91%e7%94%b0%e3%81%af%e3%82%8b%e3%81%93&f=2', '0', '', '5.0', '昭和元祿落語心中漫畫 ，執行期滿出獄的模范囚犯，不知誰給他起了個名字叫與太郎。他才剛出獄就馬上沖向交織著人生悲喜的鎮上寄席。與太郎一直無法忘懷昭和最后的大名人——八云，他下定決心要走上落語家的路，八云大師卻沒有收弟子的打算。迷上落語，不斷苦苦哀求大師的與太郎該如何是好....？昭和元祿落語心中——與[+展開]與太郎放浪篇，拉開序幕[-折疊]', 'http://cover.mangabz.com/1/55/20191203093737_360x480_43.jpg', '助六再臨篇·其十五', '16', '1654', 'https://i0.hdslb.com/bfs/manga-static/fd0cd99939cb5320e4feaedc2396730e3e5475dd.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('57', '亞人醬有話要說', 'ペトス ', 'http://www.mangabz.com/search?title=%e3%83%9a%e3%83%88%e3%82%b9+&f=2', '0', '1', '6.0', '淫魔，吸血鬼，杜爾拉汗（無頭騎士）。我們人類和稍微不同，我們被世間人成為“亞人” 對于亞人有興趣的高中生物老師·高橋鐵男，和“亞人”學生們的新學期開始了！', 'http://cover.mangabz.com/1/57/20191203094231_360x480_72.jpg', '第53話 遠兮近兮夫男女之交', '58', '5855', 'https://i0.hdslb.com/bfs/manga-static/79b9dd74eea5870fc227fcd8c86ca2dd7d02d9e3.jpg@568w_319h.jpg', '2020-03-30', null, null);
