INSERT INTO `comics` VALUES ('63', '我與你的重要談話', 'ろびこ ', 'http://www.mangabz.com/search?title=%e3%82%8d%e3%81%b3%e3%81%93+&f=2', '0', '26', '3.1', '我與你的重要談話漫畫 ，放學后的電車站，長椅的左邊坐著讀書少年，右邊坐著羞澀少女—— 你以為這是校園戀愛劇？ 不！這是校園對口相聲【誤】 來看跟蹤狂少女與中二逗比少年的電車站論戰吧！', 'http://cover.mangabz.com/1/63/20191203100146_360x480_81.jpg', '第20話', '20', '2060', 'https://i0.hdslb.com/bfs/manga-static/60eb2407064f152e22ae4af6f45b72f7352aa08b.png@600w.png', null, null, null);
INSERT INTO `comics` VALUES ('64', '炎炎之消防隊', '大久保篤', 'http://www.mangabz.com/search?title=%e5%a4%a7%e4%b9%85%e4%bf%9d%e7%ac%83&f=2', '0', '31', '4.1', '向世界襲來之烈火的恐怖和謎團。迎來的少年和伙伴們。拯救燃燒的怪物和變異人類！你聞所未聞的初體驗！SD消防員之戰！', 'http://cover.mangabz.com/1/64/20191203100424_360x480_76.jpg', '第205話 圣劍再誕', '204', '20461', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-04-02', '31', null);
INSERT INTO `comics` VALUES ('65', '古見同學有交流障礙癥', 'オダトモヒト', 'http://www.mangabz.com/search?title=%e3%82%aa%e3%83%80%e3%83%88%e3%83%a2%e3%83%92%e3%83%88&f=2', '0', '31', '5.1', '古見同學有交流障礙癥漫畫 ，少年sunday短篇五連彈的第一彈。\n古見同學是美少女，站著就是藝術，坐著就是絕贊，走三步就會被人告白。可是她有交流障礙癥！', 'http://cover.mangabz.com/1/65/20191203100626_360x480_63.jpg', '第211話 水.', '209', '20962', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('66', '初戀僵尸', '峰浪了(峰浪りょう)', 'http://www.mangabz.com/search?title=%e5%b3%b0%e6%b5%aa%e4%ba%86(%e5%b3%b0%e6%b5%aa%e3%82%8a%e3%82%87%e3%81%86)&f=2', '1', '26', '6.1', '初戀僵尸漫畫 ，周刊少年sunday新連載，描繪少年憧憬中的初戀對象與現實中的愛情反差。請諸位捫心回想一下自己的初戀對象然后再來看這部漫畫！', 'http://cover.mangabz.com/1/66/20191203100750_360x480_65.jpg', '第167話 最終回', '171', '17163', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('67', '工作細胞', '清水茜', 'http://www.mangabz.com/search?title=%e6%b8%85%e6%b0%b4%e8%8c%9c&f=2', '0', '2', '7.1', '由日本漫畫家清水茜創作的一部細胞擬人化的漫畫，將人體內的細胞世界描述成人類社會。白血球化身型男戰士，負責與病毒戰斗；紅血球化身快遞小妹負責跑腿，運輸氧氣和二氧化碳；血小板化身萌蘿莉，拿著通行禁止的旗子，負責止血，還有其他細胞負責各種工作。日常之余，還要和病毒等敵人的戰斗。', 'http://cover.mangabz.com/1/67/20191203101115_360x480_72.jpg', '動畫化通知', '20', '2064', 'https://i0.hdslb.com/bfs/manga-static/1b09fe4f2c0f790fdbc02630b297997108641ef0.png@568w_319h.png', '2020-04-02', '2', null);
