INSERT INTO `comics` VALUES ('69', '電波啊 聽著吧', '沙村廣明', 'http://www.mangabz.com/search?title=%e6%b2%99%e6%9d%91%e5%b9%bf%e6%98%8e&f=2', '0', '31', '2.2', '電波啊 聽著吧漫畫 ，鼓田美奈玲，二十多歲的單身女性。身居札幌，在湯咖喱餐廳工作。\n出乎意料地被中年男性傳媒人欺騙，又莫名其妙地作為電臺主持人出道。不是為踏平咖喱界和電臺界而奮斗拼搏，但以真愛、幸福和享樂為追求的女子仍在戰斗，沒錯就是這樣。來吧來吧來吧，電波啊聽著吧！', 'http://cover.mangabz.com/1/69/20191220104851_360x480_50.jpg', '第46話 不全是壞男人', '46', '4666', 'https://i0.hdslb.com/bfs/manga-static/97bb820f87cc5ca639c84432ea72cb0e8d288159.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('70', '天野惠渾身是破綻！', 'ねこぐち ', 'http://www.mangabz.com/search?title=%e3%81%ad%e3%81%93%e3%81%90%e3%81%a1+&f=2', '0', '31,1', '3.2', '漫畫 ，周刊少年sunday的新春攻勢新連載。\n我有一個青梅竹馬叫天野惠！初中幾年不見，高中再重逢的時候，她已經發育成了個對自己全身都是炸彈毫無自覺的大胸萌妹子！全身都是破綻，完全移不開目光！', 'http://cover.mangabz.com/1/70/20191203102548_360x480_82.jpg', '第143話 我要集中！', '149', '14967', 'https://i0.hdslb.com/bfs/manga-static/ee57ab535919985ef081fb018a8c6993c4c7a347.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('72', '平凡職業成就世界最強', 'RoGa ', 'http://www.mangabz.com/search?title=RoGa+&f=2', '0', '2', '4.2', '平凡職業成就世界最強漫畫 ，就是一個平凡的男主因為受到班中女神的青睞，而一直受到男性同學的妒忌和欺凌。 某天在課室中出現一個大傳送陣，把整個教室的所有人傳送到異世界。 基本上各人都帶著或多或少的穿越掛，職業、屬性和技能都比異世界的人強多了。其中有人天職是勇者，屬性和技能更是夸張。 但只有男主一人的職[+展開]職業、屬性和技能和極為普通，一個平凡的煉成師，和異世界的普通人沒什麼分別[-折疊]', 'http://cover.mangabz.com/1/72/20191220112052_360x480_81.jpg', '第35話', '34', '3468', 'https://i0.hdslb.com/bfs/manga-static/ad13ee8bc891cf2a913b6b8cabc75b778ac04946.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('73', '鬼滅之刃', '吾峠呼世晴', 'http://www.mangabz.com/search?title=%e5%90%be%e5%b3%a0%e5%91%bc%e4%b8%96%e6%99%b4&f=2', '0', '31,2', '5.2', '時值日本大正時期。\n傳說太陽下山后，惡鬼出沒吃人。亦有獵鬼人斬殺惡鬼、保護人們。\n賣炭少年·炭治郎，他那平凡而幸福的日常生活，在家人遭到惡鬼襲擊的那一天發生劇變。母親與四個弟妹慘遭殺害，而與他一起生還的妹妹：禰豆子亦異變成兇暴的鬼。\n在獵鬼人的指引下，立志成為獵鬼人的炭治郎與變成鬼卻尚存理智的[+展開]的禰豆子二人踏上了旅程。通過艱苦的劍術修行與賭命試煉，炭治郎成為了鬼獵人組織“鬼殺隊”的一員。\n為了讓妹妹禰豆子變回人類，為了討伐殺害家人的惡鬼，為了斬斷悲傷的連鎖，少年與鬼的戰斗不曾停歇[-折疊]', 'http://cover.mangabz.com/1/73/20191206092901_360x480_82.jpg', '第193話 困難之門開啟', '198', '19869', 'https://i0.hdslb.com/bfs/manga-static/b435a3c2d7fd4ba1a303667d49ea0fcd5de9029b.png@568w_319h.png', '2020-03-30', '31', null);
INSERT INTO `comics` VALUES ('74', '黑之創造召喚師', '幾威空  たくま朋正', 'http://www.mangabz.com/search?title=%e5%87%a0%e5%a8%81%e7%a9%ba++%e3%81%9f%e3%81%8f%e3%81%be%e6%9c%8b%e6%ad%a3&f=2', '1', '2,15', '6.2', '黑之創造召喚師漫畫 ，一個中二滿滿的騷黏，因為死神的失誤，在自宅中被沖進來的卡車干掉了，騷黏以此要挾提出要給補償的死神，拿到了點外掛，到異世界開始了更加中二滿滿的生活。', 'http://cover.mangabz.com/1/74/20191220110210_360x480_69.jpg', '第10話', '10', '1070', 'https://i0.hdslb.com/bfs/manga-static/d1491f878068d7865171abab0b979eebe68c1dc0.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('75', '歡迎來到實力至上主義的教室', '衣笠彰梧一乃ゆゆ', 'http://www.mangabz.com/search?title=%e8%a1%a3%e7%ac%a0%e5%bd%b0%e6%a2%a7&f=2', '0', '1', '7.2', '對希望的升學、就業目標有著近乎100%的達成率，全國屈指可數的名門學校·高度育成高中。使用最新式的設備當然不用說，每月發放相當于10萬元的點數，發型和私有物的攜帶也完全自由，真正的樂園般的學校，但是它的真面目卻是只有優秀的人才能受到好待遇的實力至上主義學校。', 'http://cover.mangabz.com/1/75/20191203103551_360x480_53.jpg', '第41話', '54', '5471', 'https://i0.hdslb.com/bfs/manga-static/1c8787155d8d1d99838c0021af00f4aeca01afcd.jpg@568w_319h.jpg', '2020-04-02', null, null);
INSERT INTO `comics` VALUES ('76', '9號殺手', '高橋美由紀', 'http://www.mangabz.com/search?title=%e9%ab%98%e6%a1%a5%e7%be%8e%e7%94%b1%e7%ba%aa&f=2', '1', '', '8.2', '9號殺手', 'http://cover.mangabz.com/1/76/20191203104307_360x480_56.jpg', '第21卷', '21', '2172', 'https://i0.hdslb.com/bfs/manga-static/9601e31ee3fafd03a2528f62cb7cbf0e617b8196.jpg@568w_319h.jpg', '2020-04-02', null, null);
INSERT INTO `comics` VALUES ('77', '美少年偵探團', '西尾維新小田すずか ', 'http://www.mangabz.com/search?title=%e8%a5%bf%e5%b0%be%e7%bb%b4%e6%96%b0&f=2', '0', '1', '9.2', '美少年偵探團漫畫 ，少女陰差陽錯踏入了學園最神秘社團——美少年偵探團的大門，聚集于那扇門后的美少年們居然是…而他們是否能夠完成她的委托呢？', 'http://cover.mangabz.com/1/77/20191203104548_360x480_88.jpg', '第7話', '7', '773', 'https://i0.hdslb.com/bfs/manga-static/c5376f739559c6693d78d1537fad7b367155167d.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('78', '在魔王城說晚安', '熊之股鍵次', 'http://www.mangabz.com/search?title=%e7%86%8a%e4%b9%8b%e8%82%a1%e9%94%ae%e6%ac%a1&f=2', '0', '31', '2.6', '在魔物棲息的那座城堡之中，公主在哭泣、在絕望地等待救助……', 'http://cover.mangabz.com/1/78/20191203104948_360x480_67.jpg', '第167話 不要寫錯收件人', '194', '19474', 'https://i0.hdslb.com/bfs/manga-static/58b5add2ce1cb57025c5b621915fb1c376f95108.jpg@568w_319h.jpg', '2020-04-02', null, null);
INSERT INTO `comics` VALUES ('79', '完美世界', '有賀理惠 ', 'http://www.mangabz.com/search?title=%e6%9c%89%e8%b4%ba%e7%90%86%e6%83%a0+&f=2', '0', '26', '3.6', '完美世界漫畫 ，「你愿意與殘疾人談戀愛嗎？」既美好又殘酷、既充滿希望又飽含絕望的愛情童話——', 'http://cover.mangabz.com/1/79/20191203105151_360x480_69.jpg', '第48話 最后的治療', '48', '4875', 'https://i0.hdslb.com/bfs/manga-static/21501c18841b84d3ad2c179438f84a9a486bf03e.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('80', '我立于百萬生命之上', '奈央晃德', 'http://www.mangabz.com/search?title=%e5%a5%88%e5%a4%ae%e6%99%83%e5%be%b7&f=2', '0', '2', '4.6', '我，是正確的。世界，是錯誤的。活著，就是探索自己“正義”的旅途，我終將立于百萬生命之上，找到它。', 'http://cover.mangabz.com/1/80/20191203105349_360x480_67.jpg', '第31話 惡意的連鎖與惡意破壞者', '31', '3176', 'https://i0.hdslb.com/bfs/manga-static/444216d0da320ea436628f0ee7d195f9546fa81f.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('81', '尖帽子的魔法工房', '白浜鷗 ', 'http://www.mangabz.com/search?title=%e7%99%bd%e6%b5%9c%e9%b8%a5+&f=2', '0', '', '5.6', '尖帽子的魔法工房漫畫 ，生活在小村莊的少女·可可從小開始就一直憧憬成為一名魔法使。但是，一出生就不會使用魔法的人是無法成為魔法使的，也無法見證魔法施展的瞬間……。所以，她放棄了成為魔法使的夢想。然而有一天，可可不小心看見了造訪村子的魔法使·奇弗利施展魔法的過程——。 這是一部，降臨于少女身上的，絕望[+展開]望與希望交織的魔法物語。[-折疊]', 'http://cover.mangabz.com/1/81/20191203105523_360x480_73.jpg', '第25話', '25', '2577', 'https://i0.hdslb.com/bfs/manga-static/e6a9698dd0bb63972bb82aac3f3e3b5268387fc1.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('83', '約定的夢幻島', '白井カイウ出水ぽすか ', 'http://www.mangabz.com/search?title=%e7%99%bd%e4%ba%95%e3%82%ab%e3%82%a4%e3%82%a6&f=2', '0', '2,25,17', '6.6', '約定的夢幻島漫畫 ，媽媽說外面的世界好可怕，我不信；\n但是那一天、我深深地體會到了媽媽說的是真的！\n因為不僅外面的世界、就連媽媽也好可怕……', 'http://cover.mangabz.com/1/83/20191203105842_360x480_93.jpg', '第147話 ACCUMULATED HATRED', '99', '9978', 'https://i0.hdslb.com/bfs/manga-static/c4cedb67b3bcbcc5dc80fd854a76d466a36acc28.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('84', '悲慘世界', '新進隆広', 'http://www.mangabz.com/search?title=%e6%96%b0%e8%bf%9b%e9%9a%86%e5%ba%83&f=2', '0', '31,2', '7.6', '只要無知與悲慘在大地之上滋長，這個故事就綻放著光芒，繼續質問著我們', 'http://cover.mangabz.com/1/84/20191203110008_360x480_75.jpg', '第32話 講述秘密之中的影子', '32', '3279', 'https://i0.hdslb.com/bfs/manga-static/7667bfb96827d4f0d8fe2592f406d564e88f2d9d.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('85', 'city', 'あらるけいいち ', 'http://www.mangabz.com/search?title=%e3%81%82%e3%82%89%e3%82%8b%e3%81%91%e3%81%84%e3%81%84%e3%81%a1+&f=2', '0', '11', '8.6', 'city漫畫 ，”一貧如洗，做事從不考慮后果的大學生·南云所到之處，一定會發生點什么！普通到極點的街道里生活著的些奇怪的人們之間展開的鬧劇——開幕！“', 'http://cover.mangabz.com/1/85/20191203110521_360x480_77.jpg', '第123話 反擊的狼煙', '123', '12380', 'https://i0.hdslb.com/bfs/manga-static/d342cd7ebddd8dbc79b4385f3955968538723b0e.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('86', '逃避可恥卻很管用', '海野つなみ', 'http://www.mangabz.com/search?title=%e6%b5%b7%e9%87%8e%e3%81%a4%e3%81%aa%e3%81%bf&f=2', '0', '11', '2.2', '森山實栗，25歲，就業困難，經父親介紹給他的前部下·36歲的津崎平匡做家政服務。森山的工作漸漸得到津崎的認可，但森山的父親卻提出一起回鄉下生活。不想回鄉下的森山與不想重新找家政服務的津崎，決定契約結婚——!?', 'http://cover.mangabz.com/1/86/20191203110812_360x480_74.jpg', '第47話 無精打采', '8', '881', 'https://i0.hdslb.com/bfs/manga-static/1a5886e754c71bfffad209a0d9c30217e477fba0.jpg@568w_319h.jpg', '2020-04-02', null, null);
INSERT INTO `comics` VALUES ('87', '致不滅的你', '大今良時', 'http://www.mangabz.com/search?title=%e5%a4%a7%e4%bb%8a%e8%89%af%e6%97%b6&f=2', '0', '2', '3.2', '歡迎觀看致不滅的你漫畫 ，大今良時回歸少年magazine 50期新連載：《致不滅的你》！！！將這個故事送給終有一天會死去的你我他……', 'http://cover.mangabz.com/1/87/20191203111000_360x480_55.jpg', '第119話 限制（2）', '122', '12282', 'https://i0.hdslb.com/bfs/manga-static/4d93accde43fe3d7cf45ace04b60389396c6835a.png@568w_319h.png', '2020-03-30', '2', null);
INSERT INTO `comics` VALUES ('88', '轉生成為魔劍', '丸山朝ヲ棚架ユウ', 'http://www.mangabz.com/search?title=%e4%b8%b8%e5%b1%b1%e6%9c%9d%e3%83%b2&f=2', '0', '31,2', '4.2', '歡迎觀看轉生成為魔劍漫畫 ，親爹般的無機物和沉默寡言的貓耳少女，踏上了最少三年，最高無期的旅途。', 'http://cover.mangabz.com/1/88/20191220143425_360x480_63.jpg', '第28話', '48', '4883', 'https://i0.hdslb.com/bfs/manga-static/c5ff1257cb92a6d923350689dd012b17e4716fea.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('89', '異世界的魔法太落后了', '樋辻臥命  COMTA ', 'http://www.mangabz.com/search?title=%e6%a8%8b%e8%be%bb%e5%8d%a7%e5%91%bd++COMTA+&f=2', '0', '2,15', '5.2', '異世界的魔法太落后了漫畫 ，八鍵水明是生活在現代的魔術師，并且是繼承了師傅的魔術師。在高中時，背地里以追求真理為目標，是一位純粹的神學者。有的時候在房間里閉門不出努力研究，也有時在野外試驗怪異魔術，這樣的一位生活怪異的人。 然而，某一天在與好朋友放學回家的路上，在他們前面出現了魔法陣。 是轉移魔術！[+展開]！水明突然間發覺，但是也為時已晚。水明與朋友等被拖入魔法陣，飛往了異世界[-折疊]', 'http://cover.mangabz.com/1/89/20191203112051_360x480_91.jpg', '第25話 進入都市、少女（4）', '28', '2884', 'https://i0.hdslb.com/bfs/manga-static/bc5b582edb1cb5a097c37e17ad9c5ecceca0b2c8.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('90', '深夜的奇葩戀愛圖鑒', '尾崎衣良', 'http://www.mangabz.com/search?title=%e5%b0%be%e5%b4%8e%e8%a1%a3%e8%89%af&f=2', '0', '26', '6.2', '歡迎觀看深夜的奇葩戀愛圖鑒漫畫：沉浸在少女漫畫中卻遇到了肉食系卻自己鋪床脫襪子的男人，感覺戀愛被崩壞！好不容易遇到了自己喜歡的人，對方卻是個婚后出軌的無恥男人！正在交往的對象是個剛好空窗期遇上自己，預備過完三大節慶就分手套路的男人！到底還能不能談一場愉快的戀愛啊？', 'http://cover.mangabz.com/1/90/20191203120326_360x480_73.jpg', '第51話', '52', '5285', 'https://i0.hdslb.com/bfs/manga-static/0f8a3eb3c07b79eefca1c1548f50d5eaf6474514.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('91', '五等分的花嫁', '春場ねぎ', 'http://www.mangabz.com/search?title=%e6%98%a5%e5%9c%ba%e3%81%ad%e3%81%8e&f=2', '0', '26,1', '7.2', '五等分的花嫁漫畫 ，誰說女主角只能有一個的？初次見面的女主角們！大家都各有千秋可愛非常！', 'http://cover.mangabz.com/1/91/20191203131035_360x480_68.jpg', '第108話 試看版', '113', '11386', 'https://i0.hdslb.com/bfs/manga-static/7cb98bfd4f00b3dcd76053bbf9b7bdaf952d11d3.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('92', '人形之國APOSIMZ', '貳瓶勉', 'http://www.mangabz.com/search?title=%e8%b4%b0%e7%93%b6%e5%8b%89&f=2', '0', '2,25', '2.9', '直徑十二萬公里的人工天體APOSIMZ，其體積大半都是被超構造體的殼覆蓋的地底空間。五十世紀前，在與地底的戰爭中失敗的人們被剝奪了APOSIMZ上的正當居住權，只留存在一部分極寒的地表。蔓延的人形病，在遺跡層頻繁出現的攻擊性自動機械。即使如此，人們依然在竭力生存下去——。\n', 'http://cover.mangabz.com/1/92/20191203131445_360x480_61.jpg', '第27話', '28', '2887', 'https://i0.hdslb.com/bfs/manga-static/69568253704c16ff2e1667643dc70883aafd83e7.jpg@568w_319h.jpg', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('93', 'GAMERS電玩咖！', '葵せきな高橋つばさ ', 'http://www.mangabz.com/search?title=%e8%91%b5%e3%81%9b%e3%81%8d%e3%81%aa&f=2', '0', '31', '3.9', 'Gamers！漫畫 ，《學生會的一己之見》作者新作，這是一個關于電玩的故事，性格扭曲的電玩咖們帶來的不一樣的青春錯綜系戀愛喜劇游戲開始！！', 'http://cover.mangabz.com/1/93/20191203131823_360x480_47.jpg', '第20話', '21', '2188', 'https://i0.hdslb.com/bfs/manga-static/808a2dad5219f3da81a112a0da0ab607ba9f47ad.jpg@568w_319h.jpg', '2020-03-29', null, null);
INSERT INTO `comics` VALUES ('94', '我想讓你哭泣', '文尾文', 'http://www.mangabz.com/search?title=%e6%96%87%e5%b0%be%e6%96%87&f=2', '1', '', '4.9', '就像自古紅藍出配對（？），優等生與不良也是一組常被綁在一起的屬性。透過價值觀與背景的沖突，刻劃雙方之間的互動，無論是要當好朋友或情侶都很萬用。漫畫家文尾文老師本月百合新刊我想弄哭你，主打優等生少女、不良少女從兩條平行線到逐漸拉近距離的故事！', 'http://cover.mangabz.com/1/94/20191203132407_360x480_58.jpg', '特典', '44', '4489', 'https://i0.hdslb.com/bfs/manga-static/a8681a3c55850f87f404e1effce36e27ba3128ef.jpg@568w_319h.jpg', '2020-03-29', null, null);
