INSERT INTO `comics` VALUES ('104', '死神少爺與黑女仆', '井上小春 ', 'http://www.mangabz.com/search?title=%e4%ba%95%e4%b8%8a%e5%b0%8f%e6%98%a5+&f=2', '0', '26,15', '6.6', '死神少爺與黑女仆漫畫 ，在小鎮外偏遠的森林里、其內部深處佇立著一棟大洋房。那里住著一位死神。——某一天、因為被魔女施加了「觸摸到的東西全部都會死去」的詛咒、而被周圍的人們所排斥的某位貴族的“少爺”。 現在令這位少爺最為困擾的便是…侍奉他的女仆?“愛麗絲”對他的逆性騷擾！對她感到在意的不得了的少爺來說[+展開]說，被逆性騷擾很高興…但是不能觸碰到她卻很痛苦!愛麗絲雖然似乎對少爺也十分在意、然而少爺卻無法牽起她的手。那么兩人的愛情究竟是否能夠開花結果呢!?[-折疊]', 'http://cover.mangabz.com/1/104/20191203141130_360x480_47.jpg', '第56話 雪倫', '59', '5998', 'https://i0.hdslb.com/bfs/manga-static/122053bc8222752d8f05b97d61d6b47ddc9ea9b7.png@568w_319h.png', null, null, null);
