INSERT INTO `comics` VALUES ('109', '事與愿違的不死冒險者', '丘野優/中曾根ハイヅ', 'http://www.mangabz.com/search?title=%e4%b8%98%e9%87%8e%e4%bc%98%2f%e4%b8%ad%e6%9b%be%e6%a0%b9%e3%83%8f%e3%82%a4%e3%83%85&f=2', '0', '31,2', '3.4', '在邊境之地的萬年銅級冒險者的主人公，十分不幸地遭遇到迷宮深處的強大魔物，敗北了。當他回過神來，已然變成骷髏人。如此一來他甚至都無法回到城鎮里，在苦惱過后，他回想起魔物存在進化這件事。總而言之，他決定先以得到肉體為目標，在迷宮里打倒魔物。', 'http://cover.mangabz.com/1/109/20191220112556_360x480_76.jpg', '第18話 一枚銅幣的委托', '19', '19103', 'https://i0.hdslb.com/bfs/manga-static/fd42ae3b93da180cbee0f17fd32cdd1f85d060ff.png@568w_319h.png', null, null, null);
