INSERT INTO `comics` VALUES ('115', '總之就是非常可愛 fly me to the moon', '畑健二郎 ', 'http://www.mangabz.com/search?title=%e7%95%91%e5%81%a5%e4%ba%8c%e9%83%8e+&f=2', '0', '26', '9.4', '總之就是非常可愛 fly me to the moon漫畫 ，凜冬之中邂逅的少女，櫻色的秀發在銀白的月光下飛舞，拯救了男主角由崎星空的她究竟是……？總之就是非常可愛！！畑健二郎全新連載！（盡管看上去是阿姆斯特朗回旋加速噴氣式旋風管家2-關于和老公的婚后幸福生活的事——桂雛菊外傳）', 'http://cover.mangabz.com/1/115/20191203144027_360x480_54.jpg', '第57話', '61', '61109', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('116', '不工作細胞', '杉本萌 ', 'http://www.mangabz.com/search?title=%e6%9d%89%e6%9c%ac%e8%90%8c+&f=2', '0', '', '2.0', '俗話說不工作者不得食，然而在我們身體內這個殘酷的業界中，也依然有著一群任性的老人【劃掉】新人細胞拒絕著分化（工作）悠閑度日。究竟他們什么時候才可以走出學生宿舍呢？高人氣細胞擬人漫畫《工作細胞》番外——《不工作細胞》絕贊連載中！', 'http://cover.mangabz.com/1/116/20191203144236_360x480_61.jpg', '第18話 脫核式', '23', '23110', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('117', '周刊少年小八', '增田英二', 'http://www.mangabz.com/search?title=%e5%a2%9e%e7%94%b0%e8%8b%b1%e4%ba%8c&f=2', '1', '31,1', '3.0', '《I am…》作者“增田英二老師〞新連載 本作是向往成為「主角」的八坂八起通稱“小八〞立志成為漫畫家的故事。小八曾因憧憬某部漫畫而打過一段時間棒球，卻慘淡收場。現在他懷著成為漫畫家的夢想，進入了「鬼之濱漫畫學園」這所專門學校。而入學當日，他與已經獲得連載資格的三毛和體驗入學時向自己搭話的少女宮子相遇[+展開]遇，故事就此展開…[-折疊]', 'http://cover.mangabz.com/1/117/20191203144433_360x480_85.jpg', '第42話', '42', '42111', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('118', '租借女友月田小姐', '時田時雨 ', 'http://www.mangabz.com/search?title=%e6%97%b6%e7%94%b0%e6%97%b6%e9%9b%a8+&f=2', '0', '', '4.0', '26歲社畜星野理人，上一次與女性好好說話是什么時候呢？為了想要能夠與女性好好交流而選擇了低難度的約會！那就是租借女友！——然而出現在會面場所的這個奇妙的女性是……？', 'http://cover.mangabz.com/1/118/20191203144739_360x480_46.jpg', '第14話', '14', '14112', 'https://i0.hdslb.com/bfs/manga-static/60eb2407064f152e22ae4af6f45b72f7352aa08b.png@600w.png', null, null, null);
INSERT INTO `comics` VALUES ('119', '化物語', '大暮維人/西尾維新', 'http://www.mangabz.com/search?title=%e5%a4%a7%e6%9a%ae%e7%bb%b4%e4%ba%ba%2f%e8%a5%bf%e5%b0%be%e7%bb%b4%e6%96%b0&f=2', '0', '', '5.0', '故事講述高中生阿良良木歷在機緣巧合之下，無意間發現2年中從未交流過的同班同學——戰場原黑儀的秘密。為了不讓自己的秘密暴露，戰場原不斷威脅阿良良木。但實際上，阿良良木本身與戰場原一樣，隱藏著不為人知的詭異秘密。而在這個城市內，尚有更多怪物出沒。', 'http://cover.mangabz.com/1/119/20191218155827_360x480_98.jpg', '第78話', '115', '115113', 'https://i0.hdslb.com/bfs/manga-static/9776c463aefb5a568dc2dc778502200e978fb148.jpg@600w.jpg', null, null, null);
INSERT INTO `comics` VALUES ('120', '工作細菌', '清水茜 ', 'http://www.mangabz.com/search?title=%e6%b8%85%e6%b0%b4%e8%8c%9c+&f=2', '0', '', '6.0', '工作細菌漫畫 ，安分待在人體內不亂跑的細菌們的不安分日常！“什么！我們明明是在履行職責！笨蛋主人。”這般抗議的他們究竟在腸道里干著怎樣的工作？18年7月新番《工作細胞》番外第二彈——腸道內細菌們的工作物語。 ', 'http://cover.mangabz.com/1/120/20191220104957_360x480_59.jpg', '第17話', '22', '22114', 'https://i0.hdslb.com/bfs/manga-static/1c8787155d8d1d99838c0021af00f4aeca01afcd.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('121', '想包養男子高中生的大姐姐的故事', '英貴', 'http://www.mangabz.com/search?title=%e8%8b%b1%e8%b4%b5&f=2', '0', '1', '7.0', '想包養男子高中生的大姐姐的故事漫畫，父母借錢蒸發差點被抓走的高中生被隔壁的大姐姐給救了，之后……', 'http://cover.mangabz.com/1/121/20191203145534_360x480_41.jpg', '御姐的故事 愚人節番外', '160', '160115', 'https://i0.hdslb.com/bfs/manga-static/9601e31ee3fafd03a2528f62cb7cbf0e617b8196.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('122', '歡迎光臨千歲醬', '夏目靫子 ', 'http://www.mangabz.com/search?title=%e5%a4%8f%e7%9b%ae%e9%9d%ab%e5%ad%90+&f=2', '0', '', '8.0', '歡迎光臨千歲醬漫畫 ，住在京都的小企鵝，名叫千歲醬。毛絨絨的惹人憐愛的小企鵝千歲醬，最喜歡好吃的東西和開心的事情了。與人接觸，吃（被喂食）好吃的食物——遵從自己的好奇心，在京都的街頭轉悠。清水寺·銀閣寺·祇園……從企鵝的視角描繪大家熟知的京都名勝。令人懷念又不時感到溫暖，似乎能讓心情一下子舒暢起來，[+展開]，治愈的企鵝短篇[-折疊]', 'http://cover.mangabz.com/1/122/20191220110326_360x480_49.jpg', '第27話', '28', '28116', 'https://i0.hdslb.com/bfs/manga-static/c5376f739559c6693d78d1537fad7b367155167d.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('123', '平凡職業成就世界最強 零', 'たかやKi 白米良(廚二好き) ', 'http://www.mangabz.com/search?title=%e3%81%9f%e3%81%8b%e3%82%84Ki+%e7%99%bd%e7%b1%b3%e8%89%af(%e5%8e%a8%e4%ba%8c%e5%a5%bd%e3%81%8d)+&f=2', '0', '2,15', '9.0', '平凡職業成就世界最強 零漫畫 ，平凡職業成就世界最強的前傳', 'http://cover.mangabz.com/1/123/20191220112159_360x480_75.jpg', '第10話 麻煩的來訪者', '10', '10117', 'https://i0.hdslb.com/bfs/manga-static/58b5add2ce1cb57025c5b621915fb1c376f95108.jpg@568w_319h.jpg', null, null, null);
