INSERT INTO `comics` VALUES ('126', '小鎮的千葉君', 'プチキス ', 'http://www.mangabz.com/search?title=%e3%83%97%e3%83%81%e3%82%ad%e3%82%b9+&f=2', '0', '26', '3.1', '小鎮的千葉君漫畫 ，成為老師后班上轉來的學生和學生時期暗戀的人，他們有相似的長相、眼神，卻始終是完全不一樣的人。在不經意間，戀愛啊，就休地一下降臨了。', 'http://cover.mangabz.com/1/126/20191203151535_360x480_58.jpg', '第21話', '21', '21119', 'https://i0.hdslb.com/bfs/manga-static/444216d0da320ea436628f0ee7d195f9546fa81f.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('127', '童貞文豪', '大塚ヨウコ ', 'http://www.mangabz.com/search?title=%e5%a4%a7%e5%a1%9a%e3%83%a8%e3%82%a6%e3%82%b3+&f=2', '0', '', '4.1', '小說家駒形誠士郎是一個暢銷作家，長得帥，身材好，有錢，有名聲，但是他擁有著唯一的煩惱……那就是他還是童貞', 'http://cover.mangabz.com/1/127/20191220112917_360x480_62.jpg', '第7話', '7', '7120', 'https://i0.hdslb.com/bfs/manga-static/e6a9698dd0bb63972bb82aac3f3e3b5268387fc1.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('128', 'STRANGE', 'つゆきゆるこ ', 'http://www.mangabz.com/search?title=%e3%81%a4%e3%82%86%e3%81%8d%e3%82%86%e3%82%8b%e3%81%93+&f=2', '1', '11', '5.1', 'STRANGE漫畫 ，這本漫畫真厲害！”2018年女性榜第8位。描繪了6對共12名男性間的真摯友情與溫暖的生活故事。同時是作者的出道作品。', 'http://cover6.mangabz.com/48/47501/20190119125610_360x480_33.jpg', '第8話', '9', '9121', 'https://i0.hdslb.com/bfs/manga-static/c4cedb67b3bcbcc5dc80fd854a76d466a36acc28.jpg@568w_319h.jpg', null, null, null);
