INSERT INTO `comics` VALUES ('141', '鋼之煉金術士', '荒川弘', 'http://www.mangabz.com/search?title=%e8%8d%92%e5%b7%9d%e5%bc%98&f=2', '1', '31,2', '8.1', '愛德華和艾爾凡斯兩兄弟小時候為了令母親復活，不惜使用禁忌的煉金術“人體煉成”，可惜最后失敗告終，更要付出沉重代價──哥哥愛德華失去了左腳、而弟弟艾爾凡斯則整個人消失了，其后愛德華犧牲自己的右手換回弟弟的靈魂，并將其寄附在金屬鎧甲上。他們為了尋找讓身體回復原狀的方法和“賢者之石”，踏上緊張刺激的冒險旅[+展開]旅程[-折疊]', 'http://cover.mangabz.com/1/141/20191202120537_360x480_61.jpg', '外傳：9 后續', '79', '79124', 'https://i0.hdslb.com/bfs/manga-static/1a5886e754c71bfffad209a0d9c30217e477fba0.jpg@568w_319h.jpg', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('149', '網球王子', '許斐剛', 'http://www.mangabz.com/search?title=%e8%ae%b8%e6%96%90%e5%88%9a&f=2', '1', '34', '2.2', '取得美國少年網球大賽4年冠的，被譽為天才少年的越前龍馬，跟家人回國后，加入以網球聞名的\"青春學園\"國中部。龍馬加入不久后便順利成為 \"青春學園\" 的首位1年級正選球員，與前輩們一起參加地區預賽.....', 'http://cover.mangabz.com/1/149/20191202113559_360x480_61.jpg', '第379話', '119', '119125', 'https://i0.hdslb.com/bfs/manga-static/cf8297a31bb28c80e02402fce07ffea8b037e3a5.jpg@600w.jpg', null, null, null);
INSERT INTO `comics` VALUES ('150', '噬魂師', '大久保篤', 'http://www.mangabz.com/search?title=%e5%a4%a7%e4%b9%85%e4%bf%9d%e7%ac%83&f=2', '1', '25', '3.2', '吃掉99個人和1個魔女的靈魂之后，就可以成為「死神的武器」。一個「好色又愛好炫耀」的「工匠」、一個幾時都要「有型」的「武器」、一個永遠追求「對稱」的死神之子...誰能成功制造出「死神武器」？收集靈魂的冒險旅程爆笑展開... ...', 'http://cover.mangabz.com/1/150/20191202131905_360x480_66.jpg', '第113話', '62', '62126', 'https://i0.hdslb.com/bfs/manga-static/c5ff1257cb92a6d923350689dd012b17e4716fea.jpg@568w_319h.jpg', '2020-03-30', '25', null);
INSERT INTO `comics` VALUES ('152', '竹劍少女', '土塚理弘五十嵐あぐり', 'http://www.mangabz.com/search?title=%e5%9c%9f%e5%a1%9a%e7%90%86%e5%bc%98&f=2', '1', '34', '4.2', '室江高中劍道部的指導老師石田虎侍(通稱小次郎)是一個每天為飯錢煩惱的貧窮老師有一天，他為了一句隨口說說的話(?)，開始發奮，為了女社員們的強化開始努力這句隨口說說的話是...？', 'http://cover.mangabz.com/1/152/20191202120833_360x480_51.jpg', '第117話', '53', '53127', 'https://i0.hdslb.com/bfs/manga-static/bc5b582edb1cb5a097c37e17ad9c5ecceca0b2c8.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('153', '尸姬', '赤人義一', 'http://www.mangabz.com/search?title=%e8%b5%a4%e4%ba%ba%e4%b9%89%e4%b8%80&f=2', '1', '', '5.2', '大元帥系真言密教宗派之一光言宗有一種神秘的法術，令那些對人世間仍有眷戀的女性死尸變成有思想有感情能走動的尸姬。尸姬的能力比常人強數倍，更有不死之身，她們必須與光言宗的和尚訂下契約，把其他為禍人間的僵尸殺死。只要殺滿一百零八具就可以圓約，升上天堂。女主角星村真姬那，與光言宗的契約僧田神景世訂下契約，以[+展開]以追殺其他僵尸及找出殺死自己的仇人七星為生。然而景世不幸戰死，契約轉來其收養的少年花神旺里身上，同時勢力最大的敵人，以北斗為首的七星開始展開陰謀。更為驚人的是“殺滿一百零八具尸便可以升上天堂“的承諾并非如此，故事究竟會如何發展…[-折疊]', 'http://cover.mangabz.com/1/153/20191202132244_360x480_64.jpg', '完全手冊 尸解教典', '0', '128', 'https://i0.hdslb.com/bfs/manga-static/0f8a3eb3c07b79eefca1c1548f50d5eaf6474514.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('154', '隱之王', '鐮谷悠希', 'http://www.mangabz.com/search?title=%e9%95%b0%e8%b0%b7%e6%82%a0%e5%b8%8c&f=2', '1', '25', '6.2', '隱王漫畫 ，六條壬晴是一個對周遭的人事物都漠不關心的中學生，可是他的體內卻隱藏著忍者的世界（也就是隱世）最強的秘術「森羅萬象」。為了奪取這種無與倫比的力量，源自伊賀忍者的「灰狼眾」全體出動，誓言要將壬晴帶回伊賀之里。 另一方面，壬晴的英語教師云平?帷?杜蘭達與壬晴的同學虹一都是萬天之里的忍者，他們的[+展開]的任務就是保護壬晴的安全。一場「森羅萬象」的爭奪戰將各方忍者捲入其中，壬晴若想恢復獨善其身的生活，唯一的辦法就是成為隱王！於是他被迫走進隱世，迎向未知的挑戰！[-折疊]', 'http://cover.mangabz.com/1/154/20191202120334_360x480_44.jpg', '第72話', '38', '38129', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-30', '25', null);
INSERT INTO `comics` VALUES ('156', '荒川爆笑團', '中村光', 'http://www.mangabz.com/search?title=%e4%b8%ad%e6%9d%91%e5%85%89&f=2', '0', '31', '7.2', '都會中的安樂窩－－荒川河河床是一塊天朗氣清、水景迷人的小天地，\n一群樂天、愛幻想的電波族就聚居在這裡。\n\n勝組優秀青年\"小招\"與游民美少女\"小珊\"，\n兩人因緣際會展開了一段不可思議的同居生活。\n\n一段愛情故事在荒川河畔就此展開，\n這究竟是喜劇亦或是……', 'http://cover.mangabz.com/1/156/20191202115226_360x480_46.jpg', '第11話', '11', '11130', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-30', '1', null);
INSERT INTO `comics` VALUES ('157', '黑執事', '樞梁', 'http://www.mangabz.com/search?title=%e6%9e%a2%e6%a2%81&f=2', '0', '15', '8.2', '執事者，連這種程度的事情都做不了的話又該怎么辦呢？英國名門貴族法多姆海恩家的執事，雪巴斯查恩。在知識、教養、品味、料理、武術……等所有的方面都表現得十分完美。侍奉著年僅12歲的主人，漆黑的燕尾服搖晃著，搖晃著。適合世界上最好喝的紅茶的執事漫畫在此奉獻給您…… 我有生之年……都會當你的執事——', 'http://cover.mangabz.com/1/157/20191202132050_360x480_69.jpg', '第148話 那個執事、慘笑', '0', '131', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', '2020-03-30', '15', null);
INSERT INTO `comics` VALUES ('158', '潘朵拉之心', '望月淳', 'http://www.mangabz.com/search?title=%e6%9c%9b%e6%9c%88%e6%b7%b3&f=2', '1', '26,15', '9.2', '奧茲.貝莎流士在15歲的成人儀式上遭遇到血紅般的災難. \n為了莫須有的罪名,跌入永遠的黑暗牢獄,并在那里遇到了艾利絲......', 'http://cover.mangabz.com/1/158/20191202133110_360x480_49.jpg', '第104話', '51', '51132', 'https://i0.hdslb.com/bfs/manga-static/1b09fe4f2c0f790fdbc02630b297997108641ef0.png@568w_319h.png', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('159', '咲SAKI', '小林立', 'http://www.mangabz.com/search?title=%e5%b0%8f%e6%9e%97%e7%ab%8b&f=2', '0', '34', '2.6', '21世紀…有兩位天才女高中生，降臨在這個靠打麻將實力來左右人生的時代。\n一位是每一次都能夠以正負0分的方式打完牌局的少女．宮永咲。\n另一位是在全國中學生麻將大賽個人組中奪冠的少女．原村和。\n當兩人的生存之道交會在一起時，熱血沸騰的故事就拉開序幕了！', 'http://cover.mangabz.com/1/159/20191202114053_360x480_69.jpg', '第148話', '0', '133', 'https://i0.hdslb.com/bfs/manga-static/97bb820f87cc5ca639c84432ea72cb0e8d288159.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('161', '食夢者', '大場鶇小畑健', 'http://www.mangabz.com/search?title=%e5%a4%a7%e5%9c%ba%e9%b8%ab&f=2', '1', '31,25', '3.6', '現實主義諷刺題材的新連載！死亡筆記完結的兩年后：大場鶇×小畑健 期望的復活！！故事講述的主人公真誠是一名初三的學生，和大多數人一樣對未來并沒有什么打算，只想順其自然的生活，他有著繪畫的才能同時暗戀著同班的亞豆。就在一天下課后，他發現自己畫有亞豆肖像的筆記本忘在學校了，為了防止被別人發現這個秘密，他急[+展開]急速的跑回了學校。而他的筆記本已經被一個人拿在了手里，那個人是全班學習最好的學生高木。高木對想要拿回筆記本的真誠提出了一個條件：我來寫劇本，你來繪畫，讓我們一起成為漫畫家吧。為夢想,兩人踏上成為漫畫家的道[-折疊]', 'http://cover.mangabz.com/1/161/20191218161448_360x480_66.jpg', '第176話', '176', '176134', 'https://i0.hdslb.com/bfs/manga-static/fda17d74b3989eb07f94df03da1b614273504da4.png@600w.png', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('162', '海貓鳴泣之時Ep1', '龍騎士', 'http://www.mangabz.com/search?title=%e9%be%99%e9%aa%91%e5%a3%ab&f=2', '1', '', '4.6', '海貓鳴泣之時EP1漫畫 ，《　故事發生在日本伊豆群島中一個名為六軒島的小島上。這里是是大富豪右代宮家的私有領地。每年的10月，右代宮家家庭會議就在這里召開。屆時該家族所有成員都會來到島上。1986年10月4日，由于當家右代宮金藏病重，來參加家族會議的幾個子女都在為遺產分割問題而爭吵不休——他們的目標[+展開]標不僅僅是金藏的龐大資產和六軒島的所有權，更包括傳說中金藏賴以發家的10噸黃金。而在書房里閉門不出的金藏完全不屑于理睬如禿鷲般的兒女們，只專注于某種神秘的魔法中。由于臺風的緣故，所有人都被困在島上不能出去。署名魔女的神秘信件突然出現，聲稱要接收右代宮家全部的家產；正當大家不知所措的時候，接踵而來的連續殺人事件又讓所有人陷入了恐慌：兇手是誰？為何殺人？魔女真的存在么[-折疊]', 'http://cover.mangabz.com/1/162/20191202114758_360x480_71.jpg', '第23話', '23', '23135', 'https://i0.hdslb.com/bfs/manga-static/ee57ab535919985ef081fb018a8c6993c4c7a347.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('169', '紅心王子', '桑原草太', 'http://www.mangabz.com/search?title=%e6%a1%91%e5%8e%9f%e8%8d%89%e5%a4%aa&f=2', '0', '26', '5.6', '在惡魔界成績優異、深受女孩子歡迎，同時也是下一任國王的櫻紅次郎王子，被賦予了一項秘密任務————“找出威脅惡魔界的人類，并奪走他們的靈魂”，而前往人間界留學。然而當他來到人間界，遇見少女小梅田花之后，內心卻開始起了微妙的變化…', 'http://cover.mangabz.com/1/169/20191202115748_360x480_64.jpg', '第90話', '9', '9136', 'https://i0.hdslb.com/bfs/manga-static/ad13ee8bc891cf2a913b6b8cabc75b778ac04946.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('186', '東京食尸鬼', '石田スイ', 'http://www.mangabz.com/search?title=%e7%9f%b3%e7%94%b0%e3%82%b9%e3%82%a4&f=2', '1', '31,2', '6.6', '在東京之中，某個人的絕望正在潛伏著，在群眾中潛伏著，狩獵著人類，這個吞食著死尸的怪人，人們稱其為食尸鬼，在青年和怪人相遇之時，充滿波折的命運的齒輪開始轉動了。', 'http://cover.mangabz.com/1/186/20191202161442_360x480_44.jpg', '第143話', '5', '5137', 'https://i0.hdslb.com/bfs/manga-static/7cb98bfd4f00b3dcd76053bbf9b7bdaf952d11d3.jpg@568w_319h.jpg', '2020-03-30', '31', null);
INSERT INTO `comics` VALUES ('234', '極主夫道', 'おおのこうすけ', 'http://www.mangabz.com/search?title=%e3%81%8a%e3%81%8a%e3%81%ae%e3%81%93%e3%81%86%e3%81%99%e3%81%91&f=2', '0', '11', '7.6', '元·最強黑幫老大所選的，是一條（坎坷的）家庭主夫之路——新星鬼才作家呈獻的一部居家版的俠義喜劇片。 ', 'http://cover.mangabz.com/1/234/20191220110607_360x480_66.jpg', '第44話', '48', '48138', 'https://i0.hdslb.com/bfs/manga-static/69568253704c16ff2e1667643dc70883aafd83e7.jpg@568w_319h.jpg', '2020-03-30', '36', null);
INSERT INTO `comics` VALUES ('245', 'FGO亞種特異點Ⅰ 惡性隔絕魔境', '佐佐木少年TYPE-MOON ', 'http://www.mangabz.com/search?title=%e4%bd%90%e4%bd%90%e6%9c%a8%e5%b0%91%e5%b9%b4&f=2', '0', '15', '8.6', '為了守護人理，前往“惡”蔓延的魔都·新宿！！！', 'http://cover6.mangabz.com/48/47638/20190126115341_180x240_24.jpg', '第3.2話', '8', '8139', 'https://i0.hdslb.com/bfs/manga-static/808a2dad5219f3da81a112a0da0ab607ba9f47ad.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('263', '排球少年!!', '佚名', 'http://www.mangabz.com/search?title=%e4%bd%9a%e5%90%8d&f=2', '0', '31,2', '9.2', '九龙头高中校队的得分后卫、车谷空，身高过于矮小到根本不该进篮球队，却是支撑起球队的灵魂人物。控球后卫、花园千秋，散慢、每每看到情况不对就逃避、不知道该守护什么，实际上是适时的给予技术指导的超级控球员', 'http://cover.mangabz.com/1/263/20191203165851_360x480_66.jpg', '第382話 百鬼夜行', '389', '389140', 'https://i0.hdslb.com/bfs/manga-static/674965ea8f72d296ca5252f6222d820980a693a9.png@568w_319h.png', '2020-03-31', '31', null);
INSERT INTO `comics` VALUES ('265', '石紀元（Dr.Stone）', '稻垣理一郎 Boichi', 'http://www.mangabz.com/search?title=%e7%a8%bb%e5%9e%a3%e7%90%86%e4%b8%80%e9%83%8e+Boichi&f=2', '0', '31,2', '3.2', '那一天，世界上所有的人類都……變成了石頭！ 告白未果的熱血少年大木大樹和怪異度100億%的理科天才千空 在災難中生存下來的唯二兩人 將如何開辟這石之紀元？ 原作:稻垣理一郎（光速蒙面俠原作） 作畫：BOICHI(最強不良傳說作者) 空前的SF冒險故事即將開幕！！', 'http://cover.mangabz.com/1/265/20191203170212_360x480_91.jpg', '暫無章節', '0', '141', 'https://i0.hdslb.com/bfs/manga-static/1b09fe4f2c0f790fdbc02630b297997108641ef0.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('268', '全職獵人', '富堅義博', 'http://www.mangabz.com/search?title=%e5%af%8c%e5%9d%9a%e4%b9%89%e5%8d%9a&f=2', '0', '31,2', '4.2', '為了尋找多年不見的爸爸，小岡決定成為父親一般優秀的獵人。為了達成心愿，他開始踏上崎旅程，接受重重測試。《幽游白書》作者最新力作。\n    眾準備獵人進入第二次測試，郤遇上美食獵人美滋，并且他們以“烹飪”作為第二次測試的題目。可是由于美滋的求太高，以致連一個合格的人也沒有……？？？？？\n    小[+展開]小岡等人與超長期因犯進行五局三勝制的決斗。正當兩勝兩負關鍵時刻，基路亞出戰，敵方迎戰的竟是肢解殺人狂[-折疊]', 'http://cover.mangabz.com/1/268/20191023151905_360x480_66.jpg', '第32卷', '32', '32142', 'https://i0.hdslb.com/bfs/manga-static/666d04e519f7669b11cf7c31daece486ce7b6597.png@568w_319h.png', '2020-03-31', '37', null);
INSERT INTO `comics` VALUES ('285', 'TSUBASA翼-WoRLD CHRoNiCLE 夢幻之島篇', 'CLAMP', 'http://www.mangabz.com/search?title=CLAMP&f=2', '0', '2', '5.2', '為了解除飛王最后的詛咒，小狼再次與黑鋼、法伊、摩可拿踏上前往異世界之旅！他們這次造訪的是由姬神統治的國家「儀來河內」。\n乍見之下這個國家猶如樂園，但是小狼卻看到島的一端被霧氣狀的東西包圍，森林當中的樹木枯萎的景象。為了解決島上發生的異變，小狼等人帶著四月一日提供的必需物品，前往另一個「儀來河內」─[+展開]──！[-折疊]', 'http://cover.mangabz.com/1/285/20191028101152_360x480_87.jpg', '第3卷', '3', '3143', 'https://i0.hdslb.com/bfs/manga-static/7977f7d84dbdac5fd7198749d9f0a48ec7794e8c.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('310', '魔卡少女櫻', 'CLAMP', 'http://www.mangabz.com/search?title=CLAMP&f=2', '1', '15', '6.2', '木之本櫻（小櫻）本來是一個平凡的小學四年級學生，因機緣巧合之下打開了一本放滿卡片的神秘書籍。突然一陣怪風將所有的卡片都吹走了，這時這本書的守護神，\"封印之獸\"小可出現了。原來這些被稱為\"庫洛牌\"的卡片代表著自然界和生活中的不同力量，如果失去控制，就會給世界帶來各種各樣的災難。小櫻接受了守護神小可的委[+展開]委托，帶著守護神給予的魔法棒，肩負著尋回所有\"庫洛牌\"的重要使命，經過一番努力，最終尋回所有的\"庫洛牌\"，并在小可、李小狼等人的幫助下成為\"庫洛牌\"的真正主人，使\"庫洛牌\"變成了\"小櫻牌\"。從此，世界回復安寧[-折疊]', 'http://cover.mangabz.com/1/310/20191204110054_360x480_90.jpg', '魔法少女櫻20周年紀念畫集', '13', '13144', 'https://i0.hdslb.com/bfs/manga-static/b0f677c827d0697ffe1bd1ffc5527ce00baf5caf.png@568w_319h.png', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('311', '浪客劍心', '和月伸宏', 'http://www.mangabz.com/search?title=%e5%92%8c%e6%9c%88%e4%bc%b8%e5%ae%8f&f=2', '1', '31,2', '7.2', '傳說中開拓明治新時代的維新義士中，最強、殺人無數的 劊子手拔刀齋，決心不再殺人，以逆刃刀行走江湖──他的名字叫緋村劍心。。。。另外說明，浪客劍心漫畫28本全套已經包括動畫的星霜篇和追憶篇內容，沒有單獨的星霜篇和追憶篇漫畫。', 'http://cover.mangabz.com/1/311/20191204110326_360x480_74.jpg', '第話', '40', '40145', 'https://i0.hdslb.com/bfs/manga-static/896f7fef9d02f9ae7aef17ddcc78943ebc958b12.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('312', '幽游白書', '富堅義博', 'http://www.mangabz.com/search?title=%e5%af%8c%e5%9d%9a%e4%b9%89%e5%8d%9a&f=2', '1', '31', '2.9', '主角浦飯幽助作為靈界偵探，與同伴們一起鏟除在人間為非作歹的妖怪……情節生動活潑，四個主角的形象十分飽滿，作為反面角色的戶愚呂弟和仙水等也十分深入人心。《幽游白書》的結尾在漫畫迷中頗有爭議，有著截然相反的兩種評價。但無論如何，這都是一部具有極高娛樂性和可讀性的成功漫畫。', 'http://cover.mangabz.com/1/312/20191204110623_360x480_76.jpg', '第19卷', '19', '19146', 'https://i0.hdslb.com/bfs/manga-static/bff05a9c124f4717bca77cb468af307f1ea8fa9b.jpg@568w_319h.jpg', '2020-03-31', '37', null);
INSERT INTO `comics` VALUES ('313', '水果籃子', '高屋奈月', 'http://www.mangabz.com/search?title=%e9%ab%98%e5%b1%8b%e5%a5%88%e6%9c%88&f=2', '0', '26', '3.9', ' 高屋奈月老師的《水果籃子》可謂是今年難得一見的佳作，說實話老師的畫技讓人不敢恭維，但故事的確編排得引人入勝，十幾個會變身的家伙并不是出奇的橋段，但幽默搞笑的故事情節，風趣生動的人物對白，都讓《水果籃子》成為很多讀者喜愛的優秀作品，也是白泉社近年主推的力作之一。', 'http://cover.mangabz.com/1/313/20191204111138_360x480_56.jpg', '第95話', '57', '57147', 'https://i0.hdslb.com/bfs/manga-static/c83b3efdbdc54a69ed2cd017b2b7f59de113f5d6.jpg@568w_319h.jpg', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('314', '好想告訴你', '椎名輕穗', 'http://www.mangabz.com/search?title=%e6%a4%8e%e5%90%8d%e8%bd%bb%e7%a9%97&f=2', '0', '26', '4.9', '傳說中的‘貞子’——濃黑的長發，就算是在盛夏也慘白的皮膚，陰沉的臉，連笑容都讓人感到恐懼，只要與她對視3秒就會石化。更不用說接近她，令人發毛的陰森感。就是她——黑沼爽子，一個早已經被遺忘的名字，被大家稱做‘貞子’的女生，從小學到高中都是如此。幾乎沒有人知道她的本名，天天都被人害怕著。其實，她只是陰沉[+展開]沉了一點點而已，只是而已啦。笑起來有點恐怖，周圍的空氣流動比較詭異點而已。很想很想的和大家融洽的相處，很想很想的盡自己的力量去幫助大家，她有一顆很溫柔、善良、純潔的心，但是卻包裹在‘貞子’的面皮下╮(╯-╰)╭ 就這樣，被大家誤解了，害怕了。直到他的出現，陽光般耀眼的他，親切度、爽朗度100%，會對著被稱做‘貞子’的她微笑，和她說話，發現她那顆纖細而溫柔的心，并且第一個叫出了她的名字…… 爽朗王子和被稱為女鬼‘貞子’的校園喜劇漂移登場.....[-折疊]', 'http://cover.mangabz.com/1/314/20191204112018_360x480_48.jpg', 'c97同人篇', '103', '103148', 'https://i0.hdslb.com/bfs/manga-static/43cb8525dda33dcd5d79783b958826ebb6aef7a4.png@568w_319h.png', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('315', '頭文字D', '重野秀一', 'http://www.mangabz.com/search?title=%e9%87%8d%e9%87%8e%e7%a7%80%e4%b8%80&f=2', '1', '34', '5.9', '居住在群馬縣涉川市的藤原拓海乃是一名普通的高中生……至少在他18歲以前是這樣的。這一日，經常喜歡發呆的拓海與好友武內樹在加油站打工。樹向拓海游說兩人合力買輛10年前的舊款汽車“86”（豐田TRUENO GT APEX），這樣就可以一起到秋名山去飚車。但是拓海對這種事情全無興趣，結果被打工的前輩池谷浩[+展開]浩一郎及樹兩人教訓了一頓，并被拖著一同去參加池谷所組的車隊“秋名速度之星”的聚會。深夜，愛好賽車的人自動聚集于山中，以極速挑戰著彎道。但是拓海坐在池谷的車內，卻因為對方的駕駛技術而嚇得大叫起來，結果自然遭到樹的嘲笑。當大家開始聚會時，赤城最速的車隊“REDSUNS”突然來訪，并向“速度之星”挑戰,定于下周舉行交流賽。在練習中，池谷他們發現自己的水平完全無法與“REDSUNS”相抗衡。連對方的普通隊員都無法追上，更別提“REDSUNS”的鼎梁支柱高橋涼介、啟介兄弟倆了。當大家垂頭喪氣地離去后，高橋啟介依然駕駛著愛車FD（MAZDA RX－7 FD－3S）在秋名山上飛馳著，此時突然從夜幕中駛來一部黑白相間的86！雖然是十年前的舊款車，但卻有著無與倫比的慣性漂移技術，轉眼間啟介就被對方打敗，眼睜睜地看著86揚長而去……眼看比賽日子逐漸逼近，為了秋名車手的名譽，池谷不得不按照加油站店長立花裕一所說，去尋找傳說中秋名下山道的專家——豆腐店的86。意料之外的是，那位傳說的飚車手竟然就是拓海的父親！傻乎乎的拓海卻對此一無所知，更不知曉友人樹嘴里一直提到的“86”就是自家的TRUENO。拓海的父親文太不愿插手此事，于是裕一便慫恿他讓拓海代表“速度之星”參賽。原來，拓海在初中一年級時就被文太逼著在凌晨開車送豆腐到秋名山頂的飯店，連續5年從未間斷過，也因此鍛煉出超高水準的駕駛技術。當然這件事幾乎無人知曉，而拓海也因被父親強迫對開車產生了厭倦……　　此時，拓海的同學茂木夏樹突然與他重修舊好。過去拓海在足球部里時，茂木乃是該部的經理，她的男友御木前輩是足球部的隊長。某日御木在更衣室里對夏樹之事說三道四，引起拓海的怒火并將他痛揍了一頓，就此與夏樹的關系冷淡下來。澄清誤會后，夏樹與御木斷絕了來往并開始猛追拓海，還約他星期日一同去海邊。為此拓海向父親借車，卻正中文太的圈套。文太要拓海于周六到秋名山打敗REDSUNS，還答應附送滿滿一缸油……　　終于到了交流戰時刻，秋名山上滿是聞風而來的觀眾。池谷等人引頸期盼之下，拓海駕駛著86及時趕到。在大家的一片震驚中，拓海施展出拿手的慣性漂移，緊追啟介的FD不放。接著更在5連發夾彎處，利用秋名特有的水渠拉住輪胎，在內線以神速超越了FD、取得了勝利！　　從這一天開始，“秋名86”的名號傳遍了整個群馬地區的飚車手世界……一些有實力的飚車手皆以86為目標，欲與拓海一爭長短。第二個出現的對手乃是妙義山“NightKids”的首領中里毅，他的愛車為4WD驅動、有著380匹馬力的R32（NISSAN SKYLINE GT－R），而拓海的86頂多只有150匹馬力，按常理來說是根本無法與之抗衡。中里毅在秋名的山道上與高橋涼介相遇，當他聽涼介斷言自己無法贏86時怒不可歇，親自跑到涉川加油站向拓海挑戰。正巧拓海與池谷都不在場，得意忘形的樹接下了中里的挑戰。然而拓海卻對此根本沒有興趣，于是店長裕一施展激將法引拓海參戰。而文太則為了讓86勝過R32，特地調整了一下設定。是夜，86與R32的比賽在秋名山展開，兩部車先后駛出，高橋涼介的FC（MAZDA RX－7 FC－3S）緊跟其后，將86的一舉一動都看在眼里。最后中里的R32慘敗于拓海神奇的移動攻擊之下。　　　　中里毅敗北后，“NightKids”的第二把交椅莊司慎吾也將矛頭指向86。因為慎吾與中里一直不合，他想借此機會戰勝86來取代中里的位置。慎吾向拓海提出“死亡膠布賽”，即用膠布綁住右手，這樣方向盤無法扭盡，是種非常危險的比賽方法。拓海依然拒絕比賽，但是慎吾卻故意撞擊樹的車子，令其發生事故。被激怒的拓海宛若變了個人似的，迅速領悟了“死亡膠布賽”的竅門，并讓慎吾的EG6自食其果，撞上了防護欄。經過此戰后，慎吾對賽車的觀念亦有所改變了......[-折疊]', 'http://cover.mangabz.com/1/315/20191204112332_360x480_91.jpg', '第719話', '69', '69149', 'https://i0.hdslb.com/bfs/manga-static/bbbe708198470d3716062ef53f6b1c36e35f6af8.jpg@568w_319h.jpg', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('316', '花牌情緣', '末次由紀', 'http://www.mangabz.com/search?title=%e6%9c%ab%e6%ac%a1%e7%94%b1%e7%ba%aa&f=2', '0', '26', '6.9', '小六生千早認識了來自福井的轉學生．新。新是個穩重沉默的孩子，但他卻有項出人意料之外的才藝，就是小倉百人一首競技花牌。新比任何人都快、比任何人都沉迷於搶牌的模樣，給千早帶來很大沖擊。不過，令這樣的新目不轉睛的是…千早高人一等的「才能」──', 'http://cover.mangabz.com/1/316/20191204112835_360x480_56.jpg', '青山末次訪談', '109', '109150', 'https://i0.hdslb.com/bfs/manga-static/122053bc8222752d8f05b97d61d6b47ddc9ea9b7.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('317', '最強會長黑神', '曉月あきら', 'http://www.mangabz.com/search?title=%e6%99%93%e6%9c%88%e3%81%82%e3%81%8d%e3%82%89&f=2', '0', '2', '7.9', '新銳小說家西尾維新自從2002年出道之后就作品接連不斷，同時相關的動畫化、漫畫化也層出不窮。《化物語》的動畫化7月即至，這邊漫畫方面的新作《最強會長黑神》也即將在5月發售的《周刊少年JUMP》第24號上開始連載。 \n《最強會長黑神》為西尾維新負責原作，曉月あきら負責作畫的全新漫畫。大致上是講述1年[+展開]年級就已經就任學生會長的才色兼備的超級女高中生——黑神めだか與其青梅竹馬人吉善吉的校園戀愛故事。這真是西尾維新少見的題材[-折疊]', 'http://cover.mangabz.com/1/317/20191204120806_360x480_81.jpg', '番外篇四連擊', '210', '210151', 'https://i0.hdslb.com/bfs/manga-static/3ac007ef16148e8937f3ba5d110e7b34d161a992.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('318', '只要你說你愛我', '葉月鼎', 'http://www.mangabz.com/search?title=%e5%8f%b6%e6%9c%88%e9%bc%8e&f=2', '0', '26', '8.9', '因為小時候曾經遭受朋友的背叛，橘梅這１６年來從來沒交過男朋友，甚至連朋友也沒有！獨來獨往的個性導致她成了同學欺負的對象，卻在陰錯陽差之下認識了學校裡最受歡迎的男生?黑澤大和。大和相當欣賞梅毫無所懼的個性，絲毫不在意其他人的眼光，開始主動與梅接觸。因為大和隨和的個性與古道熱腸，梅也開始逐漸卸下了心防…', 'http://cover.mangabz.com/1/318/20191204131019_360x480_60.jpg', '第6卷', '54', '54152', 'https://i0.hdslb.com/bfs/manga-static/dcd0d3e94775d5304682cd3bd47c189721afb5ba.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('319', '鬼燈的冷徹', '江口夏實', 'http://www.mangabz.com/search?title=%e6%b1%9f%e5%8f%a3%e5%a4%8f%e5%ae%9e&f=2', '0', '31', '2.6', '若說地獄就想起閻魔大王，不對不對，從現在開始，若說地獄就要想起鬼燈。最冷的鬼故事開始了。', 'http://cover.mangabz.com/1/319/20191204131536_360x480_92.jpg', '第20卷', '180', '180153', 'https://i0.hdslb.com/bfs/manga-static/cf11e78579efbb6d9faf89ee2d5a9ed6dc0f4f33.png@600w.png', null, null, null);
INSERT INTO `comics` VALUES ('323', '獵獸神兵', 'めいびい', 'http://www.mangabz.com/search?title=%e3%82%81%e3%81%84%e3%81%b3%e3%81%84&f=2', '0', '2', '3.6', '活著是罪嗎？ 揭開男子與少女的，愛與暴力與哀悼之旅的帷幕。', 'http://cover.mangabz.com/1/323/20191028103907_360x480_56.jpg', '致曾為神之眾獸 特別篇', '52', '52154', 'https://i0.hdslb.com/bfs/manga-static/b69d5d575f94d845726b73dea79c217149f64d95.jpg@568w_319h.jpg', null, null, null);
