INSERT INTO `comics` VALUES ('353', '百鬼夜行抄', '今市子', 'http://www.mangabz.com/search?title=%e4%bb%8a%e5%b8%82%e5%ad%90&f=2', '0', '', '5.6', '因寫神怪小說，而與鬼怪打交道的蝸牛，因放不下疼愛的孫子律，所以生前便與那八個鬼怪打了契約，約定要在律的身旁保護他一輩子…', 'http://cover.mangabz.com/1/353/20191204143053_360x480_100.jpg', '第105話', '33', '33156', 'https://i0.hdslb.com/bfs/manga-static/2bad1da93bc5873a5c2af50e08b0db646384a385.png@568w_319h.png', '2020-03-30', '17', null);
INSERT INTO `comics` VALUES ('354', '彩云國物語', '雪乃紗衣', 'http://www.mangabz.com/search?title=%e9%9b%aa%e4%b9%83%e7%ba%b1%e8%a1%a3&f=2', '0', '26', '6.6', '秀麗是彩云國數一數二的名門貴族，紅家的千金小姐，無奈家道中落，導致生活拮據。為了維持生計，自動上門的生意當然是來者不拒，孰料職務竟是擔任甫登基不久的“昏君”的指導老師，而且工作期間必須以貴妃身份進入后宮。在毫無任何嬪妃、空蕩蕩的后宮里，對女人毫不感興趣的古怪國王與秀麗老師之間的微妙關系即將展開……', 'http://cover.mangabz.com/1/354/20191204143231_360x480_64.jpg', '番外篇11', '42', '42157', 'https://i0.hdslb.com/bfs/manga-static/44f955d78755174e7c5fca9a2d4ed72698ebc7dd.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('355', '花樣男子', '神尾葉子', 'http://www.mangabz.com/search?title=%e7%a5%9e%e5%b0%be%e5%8f%b6%e5%ad%90&f=2', '0', '26,11', '7.6', '出生于貧寒人家的女孩杉菜，被寄予厚望的雙親想方設法的送入超貴族英德學院。在這家學校里，有四個代號“flower 4”簡稱“f4”的貴族子弟是全校學生的馬首。這四個分別名叫道明寺司、花澤類、西門總二郎、美作玲的男生其家族都顯赫異常，甚至掌控著學校的生死大權……', 'http://cover.mangabz.com/1/355/20191204143347_360x480_57.jpg', '第37卷', '38', '38158', 'https://i0.hdslb.com/bfs/manga-static/fd0cd99939cb5320e4feaedc2396730e3e5475dd.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('356', '恐怖寵物店', '秋乃茉莉', 'http://www.mangabz.com/search?title=%e7%a7%8b%e4%b9%83%e8%8c%89%e8%8e%89&f=2', '0', '17', '8.6', '歡迎來到D伯爵的寵物店。由貓、狗等您所熟悉的動物，乃至游走於華盛頓公約邊緣的珍禽異獸，這里通通都有。」從美國西海岸某城市，跨海來到日本的魔都──新宿歌舞伎町，D伯爵的寵物店重新開張。來吧，D伯爵將為您打開一扇門扉，實現您對人世的最后一線希望…… ', 'http://cover.mangabz.com/1/356/20191204143506_360x480_88.jpg', '第10卷', '10', '10159', 'https://i0.hdslb.com/bfs/manga-static/7c21fbb8bde0197d7a4c6573c156daf120209d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('357', '不可思議的游戲', '渡瀨悠宇', 'http://www.mangabz.com/search?title=%e6%b8%a1%e6%bf%91%e6%82%a0%e5%ae%87&f=2', '0', '', '9.6', '又名、包括上下兩部全套，美朱和唯打開了一本古書，進入了書中好像古代中國的神秘世界，誤會下更成為了彼此敵對的巫女。整體來說，根本就是美朱與鬼宿的愛情故事。克服了現實局限的愛情，很讓人感動。', 'http://cover.mangabz.com/1/357/20191204143637_360x480_60.jpg', '第18卷', '18', '18160', 'https://i0.hdslb.com/bfs/manga-static/5fc3d1aeb4ae1f5817574ac47e4866348a79ea17.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('358', 'level E', '富堅義博', 'http://www.mangabz.com/search?title=%e5%af%8c%e5%9d%9a%e4%b9%89%e5%8d%9a&f=2', '0', '26,11', '2.4', 'LEVEL E(后簡稱“E”)沒有一條線性的敘事結構，它提供了一個大背景，想出八個故事。稍有點像“黑客帝國”動畫短片集，只不過E的故事們相關性更強，并共享著一些重要人物。比照自己寫“幽白Revisited”時試圖理順的一些idea，覺得滿有意味——作者論的確適用廣泛啊。不少具體的情節，如“好戰的迪斯[+展開]斯坤人”，都是“富堅式虛晃”的經典出招：危機大跌眼鏡地消解于無形。宏觀看，若說幽白是撐不住了終要悖反主流套路，因而有意外的轉折變動，E 則一開始似乎就明確決定不按牌理出牌，因此情節極度不可預知[-折疊]', 'http://cover.mangabz.com/1/358/20191204143806_360x480_51.jpg', '第3卷', '3', '3161', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('359', '圣斗士星矢', '車田正美', 'http://www.mangabz.com/search?title=%e8%bd%a6%e7%94%b0%e6%ad%a3%e7%be%8e&f=2', '0', '31,2', '3.4', '在希臘圣域的格斗場上,由教皇主持的天馬座圣認爭奪已進入決賽階段,兩位打敗了九對手的斗士展開最后的對決,星矢對卡西歐士。處于劣勢的星矢記起師父魔玲的教導,引發出小宇宙,使出天馬流星拳,把卡西歐士擊倒了……', 'http://cover.mangabz.com/1/359/20191204143943_360x480_67.jpg', '第22卷', '22', '22162', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('360', '閃靈二人組', '綾峰欗人', 'http://www.mangabz.com/search?title=%e7%bb%ab%e5%b3%b0%e6%ac%97%e4%ba%ba&f=2', '0', '31,2', '4.4', '美堂蠻和天野銀次都是擁有特別能力的人。美堂蠻有一雙邪眼，他可以讓人看到幻像，是讓人看到噩夢般的幻像，還是看到幸福的幻像都是因他自己的意志來決定的，此外他還擁有“SNAKE BITE”這種能力，即是以200KILO的握力把敵人撕裂。而天野銀次的能力就是在他的體內潛伏有高壓電流，就象是電鰻一樣最高可達到[+展開]到10萬伏特，不止可以讓人類的知覺麻痹，還能破壞電子儀器，用途非常的廣泛。 他們擁有這種天賜的能力從事“奪回者”這種工作，不只是說奪取，還為了取回。把委托人被奪走的東西取回來就是他們的工作，但即使有多么特殊的能力，他們做的工作的危險性是很高的，因為他們不是不死的超人，有時他們所付出的努力未必能得到相應的回報，但他們還是繼續經營“奪回公司”[-折疊]', 'http://cover.mangabz.com/1/360/20191204144446_360x480_86.jpg', '暫無章節', '0', '163', 'https://i0.hdslb.com/bfs/manga-static/34db9291c29abdc25d07f3a3267db87176a57127.png@568w_319h.png', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('361', '紳士同盟', '種村有菜', 'http://www.mangabz.com/search?title=%e7%a7%8d%e6%9d%91%e6%9c%89%e8%8f%9c&f=2', '0', '26', '5.4', '以《尋找滿月》為眾多漫迷所喜愛的種村有菜先生，剛剛結束了連載不久之后，便不甘寂寞的在9月號的《RIBON》上開始了其最新連載《紳士同盟》。這次的作品號稱是“最高、最強、最愛”的快樂學園戀曲，整體調子比較輕松明快。種村有菜老師從《神風怪盜貞德》到《時空異邦人KYOKO》再到《尋找滿月》，作品和自己的人[+展開]人氣節節上升，希望新作再接再厲[-折疊]', 'http://cover.mangabz.com/1/361/20191204144654_360x480_83.jpg', '第47話', '17', '17164', 'https://i0.hdslb.com/bfs/manga-static/60eb2407064f152e22ae4af6f45b72f7352aa08b.png@600w.png', null, null, null);
INSERT INTO `comics` VALUES ('363', 'xxxHOLiC/四月一日靈異事件簿', 'CLAMP', 'http://www.mangabz.com/search?title=CLAMP&f=2', '0', '17', '6.4', '男主角君尋是一位擁有靈感體質的高中3年生（所謂靈感體質：就是身體很容易被鬼神附上身的意思，就是我們常說的鬼上身）。有一天他進入一間任何愿望都能為你實現的店，從此他就跌入不幸的深淵。 這里的4月1日不是愚人節而是某個有靈力的四眼男生。“這世上沒有什么偶然的事，所有的事都是注定”，四月一日君尋（奇怪的姓[+展開]姓）在注定的某日來到注定的那家可以實現任何愿望的店，見到了注定要遇見的美麗神秘的女店長一園郁子開始了他命中注定的打工生涯[-折疊]', 'http://cover.mangabz.com/1/363/20191204144856_360x480_83.jpg', '暫無章節', '0', '165', 'https://i0.hdslb.com/bfs/manga-static/d1491f878068d7865171abab0b979eebe68c1dc0.png@568w_319h.png', '2020-04-01', '17', null);
INSERT INTO `comics` VALUES ('366', '銀河英雄傳說', '藤崎龍  田中芳樹 ', 'http://www.mangabz.com/search?title=%e8%97%a4%e5%b4%8e%e9%be%99++%e7%94%b0%e4%b8%ad%e8%8a%b3%e6%a0%91+&f=2', '0', '2,25', '7.4', '藤崎龍新連載，以自己獨特的視角敘述，全新的銀河英雄傳說！', 'http://cover.mangabz.com/1/366/20191204145301_360x480_55.jpg', '第65話', '65', '65166', 'https://i0.hdslb.com/bfs/manga-static/1c8787155d8d1d99838c0021af00f4aeca01afcd.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('367', '偵探學院Q', '佐藤文也', 'http://www.mangabz.com/search?title=%e4%bd%90%e8%97%a4%e6%96%87%e4%b9%9f&f=2', '0', '17', '8.4', '佐藤文也2001年繼《金田一少年之事件簿》之后的全新偵探力作，延續金田一的輝煌神話，萬望期待，絕對不容錯過。 為了達成“成為世界第一的偵探！”愿望，小Q挑戰的是傳說中的名偵探──團守彥所主辨的“偵探學園”突破傳統的入學測驗！一起與瞬間記憶者小惠、野性男兒金太、IT小鬼數馬等強大對手，解開各種超難解的[+展開]的謎題！為了能進入最頂尖的偵探養成班“Q CLASS”，五個各懷技能的偵探少年，被逼流落在孤島上，所面對的強大敵人，竟然是世人聞風喪膽的“開膛手杰克”？接續金田一神話的精彩推理鉅著亦由此而展開…[-折疊]', 'http://cover.mangabz.com/1/367/20191204145421_360x480_49.jpg', '番外篇.2', '25', '25167', 'https://i0.hdslb.com/bfs/manga-static/9601e31ee3fafd03a2528f62cb7cbf0e617b8196.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('368', '凝眸深處', '藤崎真緒', 'http://www.mangabz.com/search?title=%e8%97%a4%e5%b4%8e%e7%9c%9f%e7%bb%aa&f=2', '0', '26', '9.4', '今井響子在雙親去世后接受了親戚的照顧,卻因為被表哥強暴而得了男性恐懼癥,從此開始了一個人的生活;但是她的公寓卻發生火災........響子只好另找住處、這時候,學生會之一的學校名人————香坂義王的一句話“請你和我一起住吧！”使得響子陷入了恐慌......... 　　是單純，還是復雜？雖然只是一個親[+展開]親吻的動作，跟自己喜歡的人親吻的時候，卻是如此不同的感受....真是不可思議啊[-折疊]', 'http://cover.mangabz.com/1/368/20191204145544_360x480_71.jpg', '第11卷', '11', '11168', 'https://i0.hdslb.com/bfs/manga-static/c5376f739559c6693d78d1537fad7b367155167d.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('369', '守護甜心', 'PEACH-PIT', 'http://www.mangabz.com/search?title=PEACH-PIT&f=2', '0', '26', '2.0', '圣夜學園的亞夢被謠傳為很棘手的小學生。她被人認為有著酷酷的性格,是非常受人矚目的存在。但是,真正的亞夢卻是……？ 希望自己能成為理想中的角色！在心里許下了這個愿望后,不知為什么出現了三個蛋！ 而從蛋中出來的是……守護角色！', 'http://cover.mangabz.com/1/369/20191204145910_360x480_73.jpg', '第12卷', '12', '12169', 'https://i0.hdslb.com/bfs/manga-static/58b5add2ce1cb57025c5b621915fb1c376f95108.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('370', '神之雫', '沖本秀亞樹直', 'http://www.mangabz.com/search?title=%e5%86%b2%e6%9c%ac%e7%a7%80&f=2', '0', '17', '3.0', '世界知名的葡萄酒評家神崎豐多香離世前立下遺囑,誰能夠說出他留下的十二支頂級葡萄酒,以及第十三支夢幻葡萄酒 「神之水滴」的名稱和出產年份,便能繼承他的遺產。為此,豐多香的兒子神崎雫與年青有為的葡萄酒評家遠峰一青展開了以酒為中心的比試！但雫竟是從來沒喝過葡萄酒的門外漢……？', 'http://cover.mangabz.com/1/370/20191204150504_360x480_58.jpg', '第36卷', '36', '36170', 'https://i0.hdslb.com/bfs/manga-static/21501c18841b84d3ad2c179438f84a9a486bf03e.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('371', '交響情人夢', '二之宮知子', 'http://www.mangabz.com/search?title=%e4%ba%8c%e4%b9%8b%e5%ae%ab%e7%9f%a5%e5%ad%90&f=2', '0', '26', '4.0', '名鋼琴家之子，優秀音樂大學生──千秋真一。想要赴歐學習指揮，卻因為飛機恐懼癥而一直無法出國。某天，不可思議的少女野田惠，突然出現在他面前，住在圾垃房里的她，是個無可救藥的怪人？這少女的出現會對真一有甚么影響呢？', 'http://cover.mangabz.com/1/371/20191204150729_360x480_65.jpg', '交響情人夢角色資料書', '38', '38171', 'https://i0.hdslb.com/bfs/manga-static/444216d0da320ea436628f0ee7d195f9546fa81f.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('372', '新恐怖寵物店', '秋乃茉莉', 'http://www.mangabz.com/search?title=%e7%a7%8b%e4%b9%83%e8%8c%89%e8%8e%89&f=2', '0', '', '5.0', '秋乃茉莉最詭異絕美力作,新連載---D伯爵新店又開張了……「歡迎來到D伯爵的寵物店。由貓、狗等您所熟悉的動物，乃至游走於華盛頓公約邊緣的珍禽異獸，這里通通都有。」從美國西海岸某城市，跨海來到日本的魔都──新宿歌舞伎町，D伯爵的寵物店重新開張。來吧，D伯爵將為您打開一扇門扉，實現您對人世的最后一線希望[+展開]望…[-折疊]', 'http://cover.mangabz.com/1/372/20191204150945_360x480_91.jpg', '第43話', '18', '18172', 'https://i0.hdslb.com/bfs/manga-static/e6a9698dd0bb63972bb82aac3f3e3b5268387fc1.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('373', '面王', '西條真二', 'http://www.mangabz.com/search?title=%e8%a5%bf%e6%9d%a1%e7%9c%9f%e4%ba%8c&f=2', '0', '', '6.0', '渡邊雙喜是明之森高中的學生, 也是學校餐廳花丸食堂的拉麵師傅,功夫了得. 某天,一位新理事長說要把明之森變成一流高中,為了改革, 花丸食堂面臨停業危機! 雙喜為了守住食堂,用拉麵對抗一流法國菜... 驚為天人的激烈拉麵最強傳說! ', 'http://cover.mangabz.com/1/373/20191204151119_360x480_77.jpg', '第2卷', '2', '2173', 'https://i0.hdslb.com/bfs/manga-static/c4cedb67b3bcbcc5dc80fd854a76d466a36acc28.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('374', '蟲師', '漆原友紀', 'http://www.mangabz.com/search?title=%e6%bc%86%e5%8e%9f%e5%8f%8b%e7%ba%aa&f=2', '0', '2', '7.0', '另一個世界，住著一群與常見動植物孑然不同的生物。遠古以來，人們敬畏地稱它們為『蟲』。當蟲的世界和人的世界重合時，蟲師銀古便會出現。\n介紹中提到的蟲顯然不是看上去肉呼呼扭動的小東西（這個概念一定要確立，否則會很別扭），而是一種最接近生命本源，類似靈體的生物（依照這種說法，鬼魂也是蟲的形態之一）。它們[+展開]們有自己的生存方式，而這種方式卻可能有駁于人類的常識，甚至危害人類的生存。于是就出現了『蟲師』這種職業，他們云游四方，對蟲的生命形態，生存方式進行研究，并接受人們的委托，解決可能是由蟲引起的怪異事件。銀古，正是他們的一員。\n很有百鬼FEEL的作品。雖然曾被某人稱做第一青年漫畫，但由于只翻譯了第一卷，并未感覺到有特別突出的地方。如果之后也是維持這樣的節奏與敘事方式，那到很可能同百鬼夜行抄一樣,成為平淡卻不無聊的系列故事[-折疊]', 'http://cover.mangabz.com/1/374/20191204151249_360x480_66.jpg', '特別篇：外傳：踩影子', '24', '24174', 'https://i0.hdslb.com/bfs/manga-static/7667bfb96827d4f0d8fe2592f406d564e88f2d9d.jpg@568w_319h.jpg', '2020-03-30', '35', null);
INSERT INTO `comics` VALUES ('375', '將國之天鷹星', 'カトウコト', 'http://www.mangabz.com/search?title=%e3%82%ab%e3%83%88%e3%82%a6%e3%82%b3%e3%83%88&f=2', '0', '2', '8.0', '戰爭硝煙迫近的時刻，飛揚起勇猛的羽翼！不同尋常的戰術。帝國歷451年，特魯齊亞歷75年，白砂糖月3號，特魯齊亞將國的西端鄰國“巴魯特萊因帝國”在兩國的邊界附近發現一具尸體，那具尸體是巴魯特萊因帝國的大臣弗朗茨。在尸體上刺著帶有特魯齊亞將國三日月紋章裝飾的箭。據說，帝國那邊在盛怒之下，把沾有弗朗茨鮮血[+展開]血的箭連同譴責的文書一起送了過來。接到這封文書的特魯齊亞將國緊急召開了將軍會議。這是山鷹將軍穆夫穆托首次出席的將軍會議…[-折疊]', 'http://cover.mangabz.com/1/375/20191204151414_360x480_70.jpg', '第19話', '92', '92175', 'https://i0.hdslb.com/bfs/manga-static/d342cd7ebddd8dbc79b4385f3955968538723b0e.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('376', '天之神話 地之永遠', '赤石路代', 'http://www.mangabz.com/search?title=%e8%b5%a4%e7%9f%b3%e8%b7%af%e4%bb%a3&f=2', '0', '', '9.0', '人稱「日巫子大人」的日本最高階巫女之第一百代巫女·宇宙，還有巫女守護·日嗣，所編織成的安慰人心的神圣故事！', 'http://cover.mangabz.com/1/376/20191204151614_360x480_74.jpg', '第22話', '13', '13176', 'https://i0.hdslb.com/bfs/manga-static/1a5886e754c71bfffad209a0d9c30217e477fba0.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('377', '尸鬼', '小野不由美', 'http://www.mangabz.com/search?title=%e5%b0%8f%e9%87%8e%e4%b8%8d%e7%94%b1%e7%be%8e&f=2', '0', '', '2.1', '周圍被隔絕了的村落，外場村。從很早以前就不怎么變化的這個村落，現在土葬的習慣也根深蒂固地殘留著。和平的村落最初發生了小小的變化，那就是不知道從哪里移筑而來的舊的西方式建筑。不知從何而來的西方建筑里的居民……某日被毀壞的村中神像……不斷地增多的死因不明的死者……到底這個村子發生了什么？在夏天突然襲擊了[+展開]了村落的悲劇的結果又是什么呢[-折疊]', 'http://cover.mangabz.com/1/377/20191204151945_360x480_66.jpg', '第10卷', '10', '10177', 'https://i0.hdslb.com/bfs/manga-static/4d93accde43fe3d7cf45ace04b60389396c6835a.png@568w_319h.png', '2020-03-30', '2', null);
INSERT INTO `comics` VALUES ('379', '信蜂', '淺田弘幸', 'http://www.mangabz.com/search?title=%e6%b7%ba%e7%94%b0%e5%bc%98%e5%b9%b8&f=2', '0', '35', '3.1', '在沒有白天的地方．安帕葛蘭多（ＡＧ），有種職業是專為住在連首都的人工太陽都照射不到的危險地區的人們送信，他們賭上性命般的將人們託付給他們的〝心〞努力送達，大家都稱他們為「信蜂」！ 看起來蠻有feel的成長型少年漫,女主角的性格很萌,整體還不錯看.....男配角其實是男主角的漫畫!', 'http://cover.mangabz.com/1/379/20191204152416_360x480_67.jpg', 'TRIBUTE', '104', '104178', 'https://i0.hdslb.com/bfs/manga-static/c5ff1257cb92a6d923350689dd012b17e4716fea.jpg@568w_319h.jpg', '2020-03-30', '35', null);
INSERT INTO `comics` VALUES ('380', '宇宙兄弟', '小山宙哉', 'http://www.mangabz.com/search?title=%e5%b0%8f%e5%b1%b1%e5%ae%99%e5%93%89&f=2', '0', '25', '4.1', '年少時代，哥哥六太與弟弟日日人眺望著星空，立下了誓約。\n２０２５年，弟弟達成誓言，當上了太空人，成為第一次長期居留月球的太空人組員之一。\n而哥哥六太卻被公司給開除，成了無業游民。\n直到弟弟寄來一封電子郵件，才讓哥哥重新面對夢想，朝目標邁進。', 'http://cover.mangabz.com/1/380/20191204152650_360x480_68.jpg', '第222話', '54', '54179', 'https://i0.hdslb.com/bfs/manga-static/bc5b582edb1cb5a097c37e17ad9c5ecceca0b2c8.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('385', '靈魂奪還者', '秋重學', 'http://www.mangabz.com/search?title=%e7%a7%8b%e9%87%8d%e5%ad%a6&f=2', '0', '2', '5.1', '聽，永不熄滅的炎炎烈火中的人們，哀號慟哭。是誰失去了靈魂，迷失在地獄的邊緣？是誰禁錮了他人的靈魂，走向了罪惡的深淵？痛苦么，人類…誰會是從紅蓮中拯救爾等的英雄呵。奪回你的心，捍衛你的靈魂，拯救你身為人類的資格與尊嚴？靈魂奪還者，以亡者名義起誓', 'http://cover7.mangabz.com/10/9547/9547.jpg', '第3話', '3', '3180', 'https://i0.hdslb.com/bfs/manga-static/0f8a3eb3c07b79eefca1c1548f50d5eaf6474514.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('405', '閃戀', '梅松町江', 'http://www.mangabz.com/search?title=%e6%a2%85%e6%9d%be%e7%94%ba%e6%b1%9f&f=2', '0', '', '6.1', '陷入低潮的人頭上會有陰沉的雨云， 因憤怒而具有攻擊性的人會從身上射出銳利的劍── 大學生．啓有著能夠看見人們心情的形狀，這種有點不可思議的能力。 某天他發現，和自己同社團， 很要好的學弟．光太郎身上出現閃耀著光芒的粉紅色愛心，并朝著自己飛過來！ 「咦!?是愛心就表示…你喜歡我嗎!?」 察覺到總是頂著[+展開]著一張撲克臉的光太郎對自己的心意，因而產生了動搖，將會....[-折疊]', 'http://cover8.mangabz.com/22/21457/20160108152026_450x600_77.jpg', '第1卷', '1', '1181', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('406', '克洛伊的信條', '今井大輔', 'http://www.mangabz.com/search?title=%e4%bb%8a%e4%ba%95%e5%a4%a7%e8%be%85&f=2', '0', '26', '7.1', '這是一個來自法國碧眼美少女JK高中生 克洛伊的故事\n她生活在日本這個陌生的環境 缺始終堅持著自己的信條。\n她說武士道精神是她從歷史劇上學來的\n她說 人生道路很長 一定不能迷失 要勇往直前', 'http://cover7.mangabz.com/22/21544/20160119232050_450x600_82.jpg', '第20話', '20', '20182', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('423', '情不自禁愛上妳', '野垣スズメ ', 'http://www.mangabz.com/search?title=%e9%87%8e%e5%9e%a3%e3%82%b9%e3%82%ba%e3%83%a1+&f=2', '0', '', '8.1', '由幾個短篇組成。輕松萌系風格，屬于飯后甜品類型。故事都很短。', 'http://cover7.mangabz.com/47/46492/20181126155455_360x480_70.jpg', '第1卷', '1', '1183', 'https://i0.hdslb.com/bfs/manga-static/64234e288b3ca3396ac223044ba58e26580c4d0c.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('438', '快樂婚禮', '円城寺真紀', 'http://www.mangabz.com/search?title=%e5%86%86%e5%9f%8e%e5%af%ba%e7%9c%9f%e7%ba%aa&f=2', '0', '26', '2.2', '小鳥游千和是個極其普通的OL。22年里男朋友個數為0，自認為自己對男人不能抱有任何想法，但有一天，小鳥游公司的社長突然出現在女公關店讓她辭掉這份工作，然后和他結婚，順便幫他還清了債款，其目的是社長大人也有不能讓步的愿意，所以才同意這樁婚姻......', 'http://cover8.mangabz.com/10/9556/9556.jpg', '外傳happy marriage01', '47', '47184', 'https://i0.hdslb.com/bfs/manga-static/ee57ab535919985ef081fb018a8c6993c4c7a347.jpg@568w_319h.jpg', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('463', '幽游白書畫集', '富堅義博 ', 'http://www.mangabz.com/search?title=%e5%af%8c%e5%9d%9a%e4%b9%89%e5%8d%9a+&f=2', '1', '2', '3.2', '幽游白書畫集 漫畫 ，《幽游白書》是日本漫畫家富堅義博于1990~1994年連載于《周刊少年Jump》的漫畫作品', 'http://cover.mangabz.com/1/463/20191106112938_360x480_35.jpg', '', '1', '1185', 'https://i0.hdslb.com/bfs/manga-static/ad13ee8bc891cf2a913b6b8cabc75b778ac04946.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('511', '進擊的巨人', '諌山創', 'http://www.mangabz.com/search?title=%e8%ab%8c%e5%b1%b1%e5%88%9b&f=2', '0', '31,2', '4.2', '悠長的歷史之中，人類曾一度因被巨人捕食而崩潰。幸存下來的人們建造了一面巨大的墻壁，防止了巨人的入侵。不過，作為「和平」的代價，人類失去了到墻壁的外面去這一「自由」……主人公艾倫·耶格爾對還沒見過的外面的世界抱有興趣。在他正做著到墻壁的外面去這個夢的時候，毀壞墻壁的大巨人出現了！', 'http://cover.mangabz.com/1/511/20191206153908_360x480_78.jpg', '第126話 驕傲', '161', '161186', 'https://i0.hdslb.com/bfs/manga-static/7cb98bfd4f00b3dcd76053bbf9b7bdaf952d11d3.jpg@568w_319h.jpg', '2020-03-30', '31', null);
INSERT INTO `comics` VALUES ('1242', '浪客行', '井上雄彥', 'http://www.mangabz.com/search?title=%e4%ba%95%e4%b8%8a%e9%9b%84%e5%bd%a6&f=2', '0', '2', '5.2', '十七歲的武藏及其友人本位田又八一起離開作州出征。可是，軍隊戰敗了，而二人僥幸生存，為了保住性命，二人逐逃出戰場…… 變成逃兵后，一路被要鏟除敗軍余黨、的武士們追殺，后得阿甲及朱實這對母女的幫助，武藏及又八得到一陣子的休息。后來因惹上敵人，又八與阿甲為了保命，背棄武藏逃走了。武藏為了向又八的親人交代而[+展開]而返回宮本村，途中因沖破門關卡而被追捕…… 返回宮本村的武藏被又八的母親、村民和官府一同設下陷阱圍困。武藏為了突圍而作出反抗。另一方面，因官兵的無能及為了盡快平息事件，澤庵聯同阿乙，一起出發捕捉武藏。武藏因饑餓及阿乙的出現而軟化，最后暈倒在阿乙懷中…… 清醒后武藏發覺自己被吊在寺前古樹上。多天任由日曬雨淋，在生死線上徘徊的武藏，就在要被之時，被澤庵所救，但澤庵卻帶其往「葬身之地」……\n浪人劍客=浪客行=宮本武[-折疊]', 'http://cover.mangabz.com/2/1242/20191217102510_360x480_69.jpg', '畫集-water', '136', '136187', 'https://i0.hdslb.com/bfs/manga-static/69568253704c16ff2e1667643dc70883aafd83e7.jpg@568w_319h.jpg', '2020-03-30', '2', null);
INSERT INTO `comics` VALUES ('1276', '黑鐵魔法使', '迷井豆腐  もくふう ', 'http://www.mangabz.com/search?title=%e8%bf%b7%e4%ba%95%e8%b1%86%e8%85%90++%e3%82%82%e3%81%8f%e3%81%b5%e3%81%86+&f=2', '0', '15', '6.2', '擺出天真無邪的笑臉，用鐵拳制裁。 最為瘋狂的異世界新女主角登場！ ', 'http://cover.mangabz.com/2/1276/20191121133802_360x480_61.jpg', '第1話', '1', '1188', 'https://i0.hdslb.com/bfs/manga-static/808a2dad5219f3da81a112a0da0ab607ba9f47ad.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('1329', '驚爆游戲U-18', '井上淳哉伊藤洋樹', 'http://www.mangabz.com/search?title=%e4%ba%95%e4%b8%8a%e6%b7%b3%e5%93%89&f=2', '0', '25', '7.2', '為了通過直播揭發『BTOOOM!』的真相、KAN自己指名自己參加了遊戲。本來打算直播\n一個女孩被男子襲擊的場面、但我醒悟了過來、想方設法把女孩救了出來。終於跟自稱巴的女孩來到了神社的KAN、訴說起了關於自己摯友的死的故事。由備受期待的新銳漫畫家井上淳哉所描繪的《BTOOOM！》正篇續作《BTOOO[+展開]OM！U-18》震撼啟動——\n[-折疊]', 'http://cover.mangabz.com/2/1329/20191217170534_360x480_64.jpg', '第7話', '7', '7189', 'https://i0.hdslb.com/bfs/manga-static/d1b9124d74550ef451386e1c3193815b7dca3ddf.png@568w_319h.png', '2020-03-31', null, null);
INSERT INTO `comics` VALUES ('1330', '高嶺之蘭', '餡蜜', 'http://www.mangabz.com/search?title=%e9%a6%85%e8%9c%9c&f=2', '0', '26,1', '8.2', '歡迎觀看高嶺之蘭漫畫：被冠以“高嶺之花”之名的蘭，其實只是個憧憬著戀愛的女生。在無意之中發現了同班同學佐伯的秘密之后，二人宛如平行線的人生開始交錯——當戀愛的花蕾遇到那束照進心底的溫柔陽光，在氤氳的水汽中，蘭的戀情將開出怎樣的花？溫暖清新的夏日戀愛故事為大家獻上！', 'http://cover.mangabz.com/2/1330/20191217170956_360x480_77.jpg', '第21話', '21', '21190', 'https://i0.hdslb.com/bfs/manga-static/2e6147c7ee17d957e898e03652b2d096610b1f5e.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1331', '1122', '渡辺ペコ', 'http://www.mangabz.com/search?title=%e6%b8%a1%e8%be%ba%e3%83%9a%e3%82%b3&f=2', '0', '11', '9.2', '相原兩口子，一子和二也。結婚７年感情穩定。無性生活，沒小孩。\n兩個人之間有一道公認的「婚外戀許可制度（承認出軌）」。\n『二子多磨』之后的渡邊老師為你揭露中年人之間結婚的謊言與真實！', 'http://cover.mangabz.com/2/1331/20191217171228_360x480_53.jpg', '第29話', '29', '29191', 'https://i0.hdslb.com/bfs/manga-static/7977f7d84dbdac5fd7198749d9f0a48ec7794e8c.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1332', '要你對我XXX', '遠山繪麻', 'http://www.mangabz.com/search?title=%e8%bf%9c%e5%b1%b1%e7%bb%98%e9%ba%bb&f=2', '0', '26', '2.6', '雪菜在班上被同學稱為「絕對零度雪女」，大家都對她退避三舍。但她的另一個身份，其實是超受歡迎的手機戀愛小說家．優P奈！這樣的她因為沒有戀愛經驗，所以為無法寫出讀者期待的戀愛小說而煩惱不已。可是在一次偶然之下，她意外知道學校最受歡迎的男同學·時雨的秘密……絕對服從，戀愛的終極任務即將展開!', 'http://cover.mangabz.com/2/1332/20191217171429_360x480_84.jpg', '第65話', '71', '71192', 'https://i0.hdslb.com/bfs/manga-static/b0f677c827d0697ffe1bd1ffc5527ce00baf5caf.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1334', '純情羅曼史', '中村春菊', 'http://www.mangabz.com/search?title=%e4%b8%ad%e6%9d%91%e6%98%a5%e8%8f%8a&f=2', '0', '26', '3.6', '天生勞碌命的大學生高橋美咲正與超有名小說家（兼BL小說家）宇佐見秋彥，盡情享受熱戀的甜蜜……這種事完全是癡人說夢。偷溜出菊川賞派對的美咲，巧遇宇佐見的哥哥春彥，卻被當面提出「我想把你從秋彥手中偷過來」的宣言……大混亂即將展開!?使出看家本領的超攻帥哥×初嚐戀愛滋味的大學生的臉紅心跳。', 'http://cover.mangabz.com/2/1334/20191217171926_360x480_93.jpg', '第14卷', '47', '47193', 'https://i0.hdslb.com/bfs/manga-static/896f7fef9d02f9ae7aef17ddcc78943ebc958b12.jpg@568w_319h.jpg', '2020-03-30', '26', null);
INSERT INTO `comics` VALUES ('1343', '信長協奏曲', '石井步', 'http://www.mangabz.com/search?title=%e7%9f%b3%e4%ba%95%e6%ad%a5&f=2', '0', '', '4.6', '討厭念書，對日本史毫無興趣的高中生三郎，某一天突然時光穿越到了戰國時代。他在那里見到體弱多病的織田信長本人，而信長的相貌竟然與三郎一模一樣。信長拜托三郎代替體弱多病自己，以織田信長的身分活下去…！？', 'http://cover.mangabz.com/2/1343/20191218091802_360x480_60.jpg', '第33話', '85', '85194', 'https://i0.hdslb.com/bfs/manga-static/7bbb8a3bc3a0efc0753dcd7777098e14b41f1738.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1344', '久住君，會察言觀色嗎', 'ますこ ', 'http://www.mangabz.com/search?title=%e3%81%be%e3%81%99%e3%81%93+&f=2', '1', '1', '5.6', '久住君，會察言觀色嗎漫畫 ，“作為學校的受歡迎女生 我…喜歡久住…這…絕對不可能的哦。” 當毫無交點的兩個人陷入戀愛之中時，單相思轉變成了喜劇！胸中心跳不已的新感覺·非接觸短篇戀愛喜劇！新連載', 'http://cover.mangabz.com/2/1344/20191218091920_360x480_46.jpg', '第5話', '58', '58195', 'https://i0.hdslb.com/bfs/manga-static/c83b3efdbdc54a69ed2cd017b2b7f59de113f5d6.jpg@568w_319h.jpg', null, null, null);
INSERT INTO `comics` VALUES ('1345', '魔女與貴血騎士', '舵英里', 'http://www.mangabz.com/search?title=%e8%88%b5%e8%8b%b1%e9%87%8c&f=2', '0', '26', '6.6', '居住在黑森林里的魔女，某天一位騎士找到了她說王找她有事請她來一趟，魔女覺得騎士是難得一見好男人就答應了…于是禁忌的魔女和異色騎士的戀愛故事就開始了…', 'http://cover.mangabz.com/2/1345/20191218092053_360x480_75.jpg', '第6卷', '18', '18196', 'https://i0.hdslb.com/bfs/manga-static/43cb8525dda33dcd5d79783b958826ebb6aef7a4.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1346', '烙印戰士', '三浦建太郎', 'http://www.mangabz.com/search?title=%e4%b8%89%e6%b5%a6%e5%bb%ba%e5%a4%aa%e9%83%8e&f=2', '0', '25', '7.6', '一部夢想與友情的矛盾信任與背叛的沖突交織成的冒險故事以歐洲中古世紀的黑暗時代為背景', 'http://cover.mangabz.com/2/1346/20191218092403_360x480_62.jpg', '迷之章：與神的對話', '143', '143197', 'https://i0.hdslb.com/bfs/manga-static/bbbe708198470d3716062ef53f6b1c36e35f6af8.jpg@568w_319h.jpg', '2020-03-30', '37', null);
INSERT INTO `comics` VALUES ('1349', '抖S幽靈不讓我睡覺', 'ときしば', 'http://www.mangabz.com/search?title=%e3%81%a8%e3%81%8d%e3%81%97%e3%81%b0&f=2', '0', '', '8.6', '歡迎觀看抖S幽靈不讓我睡覺漫畫', 'http://cover.mangabz.com/2/1349/20191218093057_360x480_70.jpg', '第2話', '2', '2198', 'https://i0.hdslb.com/bfs/manga-static/122053bc8222752d8f05b97d61d6b47ddc9ea9b7.png@568w_319h.png', null, null, null);
INSERT INTO `comics` VALUES ('1350', '異世界精靈的奴隸醬', '柑橘ゆすら稍日向夜ノみつき', 'http://www.mangabz.com/search?title=%e6%9f%91%e6%a9%98%e3%82%86%e3%81%99%e3%82%89&f=2', '0', '', '2.2', '特技是“真不愧是主人”！？由奴隸精靈送上的，稍微有點H的日常喜劇！因為某些事情變得必須在迷宮都市作為奴隸生活下去的精靈醬，與身為競爭對手的奴隸犬耳醬一起過著“真不愧是主人”的生活。在滿是奴隸的世界中精靈醬到底能不能存活下來呢！？由作弊般的主人殿下和2位奴隸醬所帶來的稍微有點H又時而腹黑(？)的日常喜[+展開]喜劇 即將開幕[-折疊]', 'http://cover.mangabz.com/2/1350/20191218093252_360x480_81.jpg', '精靈的奴隸醬 番外篇02', '84', '84199', 'https://i0.hdslb.com/bfs/manga-static/3ac007ef16148e8937f3ba5d110e7b34d161a992.jpg@568w_319h.jpg', null, null, null);
